INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100101, 1, 1, "ここに困ってる人は\nいないよね…？\nよかった♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100101, 2, 2, "冒険の準備準備…\nうん、忘れ物はなし！\n…あっ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100101, 3, 3, "リズムを意識して…\nわんつーわんつー！\nうん、調子はバッチリ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100101, 4, 4, "ここで特訓していい？\n物は壊さないように\n気をつけるね！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100101, 5, 5, "なんか落ち着かないや\nもしかして、\n困ってる人が\n近くにいるのかな…？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100101, 6, 101, "えへへ…いつも\n一緒にいてくれて\nありがとねっ！", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100101, 7, 102, "ちゃんと覚えてるよ\n騎士くんの声…\nあの時はありがとね！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100101, 8, 1, "あははっ！\nやったなー！\nお返しだー！\nこちょこちょこちょ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100101, 9, 2, "どうしたの？\nもしかして困ってる？\nあたしにまかせて！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100101, 10, 3, "えっとね…しっぽは\n触っちゃダメだよ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100101, 11, 4, "反応しない特訓…\nだったけど無理～！\n悔しいよぉ～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100101, 12, 101, "ふぁふぃ？\nやられた～！　ほっぺ\nぷにぷにしないでぇ～", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100101, 13, 102, "えへへ…\n騎士くんの手だ…\nあったかいな…♪", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 100101, 14, 1, "おはよー！\n今日も元気に\nいっちゃうよー！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 100101, 15, 2, "ユイちゃんに\nおやつ作って\nもらおうかな～♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 100101, 16, 3, "寝るのも修行だって\nこないだレイさんが\n言ってたんだ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100101, 17, 1, "ちゃんとケアして\n傷が残らないように\nしないと…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100101, 18, 2, "一回休むと\nこのままずるずる\nいきそう…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100101, 19, 3, "新しい練習相手に…\nって冗談だよ冗談！\n本気じゃないから！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100101, 20, 4, "落ち着くなぁ～\n心だけじゃなくて\n体もほぐれそう♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100101, 21, 5, "あったかい所に\nいると体が丸く\nなっちゃう…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100101, 22, 6, "いつ何が起きるか\n分からないし、\nもっと力をつけないと", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100101, 23, 7, "美味しいけど、\n食べ過ぎないように\nしないと…！！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100101, 24, 8, "文字が多いと\n眠くなっちゃう…\n危ない危ない！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100102, 26, 1, "リズムを意識して…\nわんつーわんつー！\nうん、調子はバッチリ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100102, 27, 2, "のんびりするのって\n退屈かも…\n何かして遊ばない？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100102, 28, 3, "留守番はちょっと\n苦手かも…\nなんか寂しいんだもん", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100102, 29, 4, "あたしのお友達も\n呼んできていい？\nきっと楽しいよ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100102, 30, 5, "誰も困ってないよね？\n…何をすれば\nいいのか分かんないや", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100102, 31, 101, "ちゃんと覚えてるよ\n騎士くんの声…\nあの時はありがとね！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100102, 32, 102, "…なんであたし\n騎士くんばっかり\n見てるんだろ…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100102, 33, 1, "反応しない特訓…\nだったけど無理～！\n悔しいよぉ～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100102, 34, 2, "触るのって楽しい？\n…そっか\n少しだけだよ…？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100102, 35, 3, "あたしの元気を\nわけてあげるね！\nフレー！　フレー！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100102, 36, 4, "何かムズムズする！？\nって騎士くんかぁー\nどしたの？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100102, 37, 101, "ひゃうっ！　もう…\nしっぽはだめだってば\n次やったらデコピン！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100102, 38, 102, "えへへ…\n騎士くんの手だ…\nあったかいな…♪", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 100102, 39, 1, "朝ごはんと運動！\nこれがあたしの\n元気の素だよ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 100102, 40, 2, "ユイちゃんに\nおやつ作って\nもらおうかな～♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 100102, 41, 3, "寝るのも修行だって\nこないだレイさんが\n言ってたんだ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100102, 42, 1, "これでよし♪\n騎士くん\n気づくかな…？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100102, 43, 2, "一回休むと\nこのままずるずる\nいきそう…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100102, 44, 3, "新しい練習相手に…\nって冗談だよ冗談！\n本気じゃないから！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100102, 45, 4, "こういうの\nなんか気になって\nじーって見ちゃうんだ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100102, 46, 5, "あったかい所に\nいると体が丸く\nなっちゃう…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100102, 47, 6, "いつ何が起きるか\n分からないし\nもっと力をつけないと", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100102, 48, 7, "お腹が減ると\nなんか力が\n出ないんだよね…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100102, 49, 8, "色んなことを\n知っておくのは\n大事だよね！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100201, 51, 1, "お片付けも済んだし\n今度は洗濯ものを\nたたもうかな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100201, 52, 2, "この気持ち\nもっとちゃんと\n伝えなくっちゃ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100201, 53, 3, "お茶をいれようと\n思うんだけど\n他に飲みたい人は\nいるかな？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100201, 54, 4, "戦いは\n得意じゃないけど\nお料理なら…！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100201, 55, 5, "こういう平和な\n時間が、もっと\n続くといいな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100201, 56, 101, "わたし…\nもうちょっとだけ勇気\n出してみようかな", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100201, 57, 102, "みんなのことが大好き\nも、もちろん、\n騎士クンのことも…\nな、仲間として！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100201, 58, 1, "ひゃうっ！\nな、なに？\nびっくりしたぁ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100201, 59, 2, "男の子って、\nやっぱりおっきいね。\nその…手とか\n他にもいろいろ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100201, 60, 3, "困ったことが\nあったら\nいつでも話してね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100201, 61, 4, "え！　む、虫っ！？\n取って取って！\nはやく～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100201, 62, 101, "あのね…\n一緒におでかけ\nしたいんだけど…\nダメかな？", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100201, 63, 102, "騎士クンに\n伝えたいことがあるの\nとっても大切な…\nこ、今度、話すね！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 100201, 64, 1, "お、おはよう！\nあの…朝ごはんは\nもう食べちゃった？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 100201, 65, 2, "お昼休みだね\nあの…良かったら\nお弁当…食べない？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 100201, 66, 3, "遅くまでお疲れ様\n明日も頑張ろうね\nふわぁ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100201, 67, 1, "よし…\nこれなら\n褒めてもらえるかな？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100201, 68, 2, "がんばることも\n必要だけど、\nお休みも大切だよね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100201, 69, 3, "かわいいなぁ…\nわたしも今度\n作ってみよう。\nえっと、材料は…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100201, 70, 4, "戦う前にもこうやって\n落ち着けたら\nいいのに", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100201, 71, 5, "…はへっ？\nも、もしかして今\n寝ちゃってた…？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100201, 72, 6, "騎士クンと一緒に\n冒険するなら\n体力がないと…！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100201, 73, 7, "おいしいものって\n食べ過ぎちゃうけど…\nしょうがない…よね？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100201, 74, 8, "…そっか\nこうすれば魔法が\nもっと強くなるんだ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100202, 76, 1, "洗濯と掃除\nどっちから\nはじめよう？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100202, 77, 2, "新しい魔道書を\n買いに行かなくちゃ\nもっとたくさん\n魔法を覚えたいな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100202, 78, 3, "お茶をいれようと\n思うんだけど\n他に飲みたい人は\nいるかな？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100202, 79, 4, "今日はどんな料理に\n挑戦しよう…♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100202, 80, 5, "この気持ち\nもっとちゃんと\n伝えなくっちゃ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100202, 81, 101, "みんなのことが大好き\nも、もちろん\n騎士クンのことも…\nな、仲間として！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100202, 82, 102, "騎士クンのそばに\nいられるだけで\n幸せだよ", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100202, 83, 1, "えっと、その…\nこんな所で\nこういうことされると\n恥ずかしいよ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100202, 84, 2, "え！　む、虫っ！？\n取って取って！\nはやく～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100202, 85, 3, "あ、あの…実は\n騎士クンのこと…\nううん、やっぱり\nなんでもない", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100202, 86, 4, "男の子って\nやっぱりおっきいね\nその…手とか\n他にもいろいろ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100202, 87, 101, "騎士クンに\n伝えたいことがあるの\nとっても大切な…\nこ、今度、話すね！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100202, 88, 102, "ふふふっ…そんなとこ\nツンツンしないで\nくすぐったいよ～", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 100202, 89, 1, "おはよう\nよく眠れた？　今日も\n一日、頑張ろうね♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 100202, 90, 2, "お腹空いちゃった…\nそうだ。騎士クンも\n一緒にお昼食べない？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 100202, 91, 3, "もうこんな時間…\nそろそろ寝なくちゃ\nおやすみなさい", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100202, 92, 1, "よし…\nこれなら\n褒めてもらえるかな？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100202, 93, 2, "がんばることも\n必要だけど\nお休みも大切だよね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100202, 94, 3, "かわいい～♪\n騎士クンは\nこういうのって好き？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100202, 95, 4, "戦う前にもこうやって\n落ち着けたら\nいいのに", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100202, 96, 5, "あの…！\nよ、良かったら\n一緒に…！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100202, 97, 6, "騎士クンと一緒に\n冒険するなら\n体力がないと…！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100202, 98, 7, "最近服のサイズが\n合わないんだけど…\n食べ過ぎなのかな？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100202, 99, 8, "…やっぱり\n月刊恋愛指南は\nためになる…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100301, 101, 1, "装備の手入れでも\nしようかな…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100301, 102, 2, "次に鍛えるべきは\n肉体面か精神面か\nどちらにしよう…？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100301, 103, 3, "ツムギが作ってくれた\nこの服…一体\nいつサイズを…？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100301, 104, 4, "仲間なんていらない\nそう思ってた頃も\nあったな…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100301, 105, 5, "考えごとをしていると\nつい部屋中を\n歩いてしまうな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100301, 106, 101, "彼は\nどこまで強くなるのか\n私も負けられないな", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100301, 107, 102, "私が一本を取られる\nなんてね…願い事は\nもう決まったのかな？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100301, 108, 1, "ああ、キミだったのか\n人の気配がしたから\n誰かと思ったよ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100301, 109, 2, "斬りかかるつもりなら\nちゃんとかかってきて\n…呼んだだけ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100301, 110, 3, "なに？　私に相談？\n戦いについてなら\n喜んで", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100301, 111, 4, "今のが突き？\n軽い！　もっと鋭く！\nさあ、もう一回！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100301, 112, 101, "ひゃっ！　ど、どこを\n触ってるの！？\n…油断した", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100301, 113, 102, "キミにはこれからも\n私のそばに…\nいや、なんでもない", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 100301, 114, 1, "おはよう\n今日も充実した\n一日にしていこう", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 100301, 115, 2, "そろそろ\nお茶の時間か\nキミも一緒にどう？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 100301, 116, 3, "遅くまで大変だね\nまだ仕事があるなら\n手伝おうか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100301, 117, 1, "戦いを経てもなお\n美しくあるように…\nこれでよし♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100301, 118, 2, "戦ってばかりで\n休まないと、また\nユイに怒られるな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100301, 119, 3, "ヒヨリみたいに\n練習相手に…\nいや、やめておこう", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100301, 120, 4, "これはいい…\n戦いの前の精神統一に\nもってこいじゃないか", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100301, 121, 5, "時々は落ち着いた\n時間を過ごすのも\n悪くない…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100301, 122, 6, "彼に負けないよう\n私も更に強くなろう\n共に戦うために！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100301, 123, 7, "食事は大切だけど\n食べ過ぎには\n注意しておこう…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100301, 124, 8, "ユイ…！\nこ、こんな本を\n読んでいたのか…！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100302, 126, 1, "海だけじゃなくて\n川でも釣りがしたいな\n道具も新調しよう", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100302, 127, 2, "ツムギが作ってくれた\nこの服…一体\nいつサイズを…？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100302, 128, 3, "彼は\nどこまで強くなるのか\n私も負けられないな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100302, 129, 4, "そろそろ修行の\n内容を新しくしよう\nより厳しいものにね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100302, 130, 5, "強くなって…誰にも\n妨げられない自由な\n生き方がしたい", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100302, 131, 101, "まさか風邪を引くとは\n彼の看病のおかげで\nすっかり良く\nなったけど", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100302, 132, 102, "私が一本を取られる\nなんてね…願い事は\nもう決まったのかな？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100302, 133, 1, "どうしたの？\nなんでもない？\nそれなら良かった", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100302, 134, 2, "あんまり突っつくと\nお返しするよ？\n覚悟は出来てる？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100302, 135, 3, "ねぇ、今度また\n釣りに行かない？\n大きいのを狙おう", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100302, 136, 4, "修行がしたいの？\nそれを早く言ってよ\nすぐに出発しよう！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100302, 137, 101, "ひょっとして\n今のも一本だなんて\n言わないよね？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100302, 138, 102, "キミにはこれからも\n私のそばに…\nいや、なんでもない", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 100302, 139, 1, "今日は仕事？\nそれとも修行？\n良ければ付き合うよ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 100302, 140, 2, "休息も時には\n必要だと、仲間から\n教わったよ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 100302, 141, 3, "遅くまで大変だね\nまだ仕事があるなら\n手伝おうか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100302, 142, 1, "髪の長さを少し\n変えてみようかな…\nわ、私は何を…！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100302, 143, 2, "休息があってこそ\n万全な状態で\n戦えるんだ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100302, 144, 3, "ヒヨリみたいに\n練習相手に…\nいや、やめておこう", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100302, 145, 4, "体と同様に\n心もほぐれるね…\nはぁ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100302, 146, 5, "休む時は休む\nヒヨリもそろそろ\n覚えて欲しいな…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100302, 147, 6, "彼に負けないよう\n私も更に強くなろう\n共に戦うために！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100302, 148, 7, "修行のせいか\n最近食べる量が\n増えてきたような…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100302, 149, 8, "ユイ…！\nこ、こんな本を\n読んでいたのか…！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100401, 151, 1, "お宝の予感！\n部屋中を\n探検しちゃうぞ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100401, 152, 2, "落とし穴…どこに\n作ったんだっけ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100401, 153, 3, "うえ～ん！\n…嘘泣きしたら\n相手は油断するかな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100401, 154, 4, "ハニートラップって\nすごく甘いお菓子で\nイタズラするのかな？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100401, 155, 5, "かくれんぼする人\nこの指、と～まれ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100401, 156, 101, "ミソギ以外の人に\nイタズラされちゃ\nダメだよ！", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100401, 157, 102, "ミソギと遊ぶ？\nミソギに遊ばれる？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100401, 158, 1, "いいこと思いついた！\nい、イタズラとかじゃ\nないよ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100401, 159, 2, "うわっ！？\n　にいちゃんが、\nミソギにイタズラ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100401, 160, 3, "にいちゃんの\n通りそうなところに\nバナナの皮を…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100401, 161, 4, "にいちゃんのオデコと\nホッペと鼻と目と耳に\n落書きを…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100401, 162, 101, "ここ、ミソギ探検隊の\n基地にしようよ！", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100401, 163, 102, "だ～れだ…って？\nにいちゃんの声くらい\nわかるよ！\n大好きだもん♪", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 100401, 164, 1, "にいちゃん、おはよ！\n目覚まし時計を\n止めておいたのに、\nよく起きられたね～♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 100401, 165, 2, "にいちゃんが\n昼寝したら、\nイタズラし放題♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 100401, 166, 3, "夜の探検も\nおもしろそう！\nねぇ出かけちゃダメ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100401, 167, 1, "イタズラには\nお色気も必要…\nうん、完璧！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100401, 168, 2, "座ったら、ブーッって\nいう音が出たら、\nおもしろいな～♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100401, 169, 3, "かわいい！\nミソギ探検隊の\nマスコットにしよう♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100401, 170, 4, "吸うとくしゃみが\n止まらなくなるお香を\nここに…くしゅっ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100401, 171, 5, "にひひ…イタズラの\n証拠、ここで\n燃やしちゃおう～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100401, 172, 6, "探検家は\n体力勝負だよー！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100401, 173, 7, "みんなに分けて\nあげようかな～\n激辛ソースも\n入れちゃうけどね！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100401, 174, 8, "こういう所に\n宝の地図が\n隠れてるんだよね～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100402, 176, 1, "お宝の予感！\n部屋中を\n探検しちゃうぞ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100402, 177, 2, "うぅ、探検に出たい！\nじっとしてなんか\nいられないよ～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100402, 178, 3, "うえ～ん！\n…嘘泣きしたら\n相手は油断するかな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100402, 179, 4, "ハニートラップって\nすごく甘いお菓子で\nイタズラするのかな？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100402, 180, 5, "かくれんぼする人\nこの指、と～まれ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100402, 181, 101, "にいちゃんのオデコと\nホッペと鼻と目と耳に\n落書きを…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100402, 182, 102, "にいちゃんが喜ぶ\nイタズラ、何かない\nかな～？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100402, 183, 1, "ミソギがしかけた\nイタズラ\n見つけられるかな？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100402, 184, 2, "探検する？\n冒険する？\nそれとも…\nイタズラされる？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100402, 185, 3, "将来の夢は探検家！\n探したい物はないけど", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100402, 186, 4, "にいちゃんに宿題！\n落とし穴を10個\n掘ること！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100402, 187, 101, "だ～れだ…って？\nにいちゃんの声くらい\nわかるよ！\n大好きだもん♪", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100402, 188, 102, "ここ、ミソギ探検隊の\n基地にしようよ！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 100402, 189, 1, "にいちゃん\n探検に行こうよ！\n今からなら遭難しても\n夜には帰れるよ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 100402, 190, 2, "にいちゃんが昼寝したら\nイタズラし放題♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 100402, 191, 3, "夜の探検も\nおもしろそう！\nねぇ出かけちゃダメ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100402, 192, 1, "イタズラには\nお色気も必要…\nうん、完璧！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100402, 193, 2, "ゆっくりまったりして\n次のイタズラを\n考えよ～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100402, 194, 3, "かわいい！\nミソギ探検隊の\nマスコットにしよう♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100402, 195, 4, "吸うとくしゃみが\n止まらなくなるお香を\nここに…くしゅっ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100402, 196, 5, "にひひ…イタズラの\n証拠、ここで\n燃やしちゃおう～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100402, 197, 6, "探検家は\n体力勝負だよー！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100402, 198, 7, "探検のおやつに\nぴったりかも～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100402, 199, 8, "こういう所に\n宝の地図が\n隠れてるんだよね～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100601, 201, 1, "音楽は全部好きだけど\n一番好きなのは\nやっぱりジャズかな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100601, 202, 2, "はぁ、はぁ…\n一人でもいっぱい\nしないと…\n特訓…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100601, 203, 3, "お姉ちゃんには\nもっと自信を\n持ってほしいなぁ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100601, 204, 4, "お姉ちゃんのマネ\nしちゃおうかな？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100601, 205, 5, "双子って、\n好みのタイプも\n似ちゃうのかな？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100601, 206, 101, "お兄ちゃんと私は\n相性抜群です♪", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100601, 207, 102, "もう待ちきれない…\nお兄ちゃん、\n早く帰って来て！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100601, 208, 1, "あんっ…着替えよう\nと思ったのに\nお兄ちゃんのエッチ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100601, 209, 2, "うふふ、お兄ちゃん！\n今日は何を\nするんですか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100601, 210, 3, "そんなところ\n触っちゃダメ♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100601, 211, 4, "お兄ちゃん、イジワル\nしないでください…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100601, 212, 101, "お兄ちゃん、もっと\n上級編のテクニック、\n教えてくださいね！", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100601, 213, 102, "コーチ、\n今日も特訓\nお願いします！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 100601, 214, 1, "おはようございます\n昨夜は楽しかった\nですね、うふふ♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 100601, 215, 2, "こんな明るい時間から\nす、するんですか…\n二人っきりの特訓…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 100601, 216, 3, "夜はこれからですよ\nお兄ちゃん♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100601, 217, 1, "世界一、かわいく\nなるんだから♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100601, 218, 2, "気持ちいい♪\nもう立てないよ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100601, 219, 3, "かわいい♪\nアカリのライバル\nだね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100601, 220, 4, "はぁ…気持ちいい、\n私、このままダメに\nなっちゃいそう…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100601, 221, 5, "はぁ…アカリ、\nとろけちゃう…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100601, 222, 6, "はぁ…はぁはぁ、\n私…もう…ダメ\n限界です…！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100601, 223, 7, "わぁ、おいしい～\nけど食べ過ぎは美容に\nよくないですよね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100601, 224, 8, "この楽譜、\nサックスで吹いて\nみたいなぁ♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100602, 226, 1, "このごろ一人でいると\nお兄ちゃんのこと\nばかり考えちゃう…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100602, 227, 2, "はぁ、はぁ…もっと\nいっぱいしなくちゃ\n…練習", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100602, 228, 3, "このお部屋、なんだか\n落ち着きます…\nお兄ちゃんが\nいるから？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100602, 229, 4, "みんなかわいいな～\n世界一かわいくなる\nのは、難しいな…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100602, 230, 5, "双子って、\n好みのタイプも\n似ちゃうのかな？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100602, 231, 101, "いつか世界でいちばん\nかわいくなって\nお兄ちゃんと…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100602, 232, 102, "もう待ちきれない…\nお兄ちゃん、\n早く帰って来て！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100602, 233, 1, "あんっ…着替えよう\nと思ったのに\nお兄ちゃんのエッチ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100602, 234, 2, "二人きりの秘密の特訓\n今度はいつですか？\n待ち遠しいです…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100602, 235, 3, "え？　ここでするの？\nみんなの前で恥ずか\nしいな…筋トレ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100602, 236, 4, "お兄ちゃん、イジワル\nしないでください…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100602, 237, 101, "お兄ちゃんといると\nわ、私…ドキドキ\nしてきちゃう…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100602, 238, 102, "コーチ、\n今日も特訓\nお願いします！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 100602, 239, 1, "おはようございます\n昨夜は楽しかった\nですね、うふふ♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 100602, 240, 2, "お兄ちゃんに\n食べてもらいたいなぁ\n手作りのお昼ごはん", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 100602, 241, 3, "お風呂入ってきますね\nそのあとは…\n二人でい～っぱい\n遊びましょうね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100602, 242, 1, "お姉ちゃんのマネ\nしちゃおうかな？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100602, 243, 2, "気持ちいい♪\nもう立てないよ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100602, 244, 3, "かわいい♪\nアカリのライバル\nだね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100602, 245, 4, "はぁ…気持ちいい、\n私、このままダメに\nなっちゃいそう…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100602, 246, 5, "あったか～い…\nまるでお兄ちゃんが\n隣にいる時みたい", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100602, 247, 6, "汗をかくと\n気持ちいいですよね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100602, 248, 7, "お兄ちゃんの特訓に\n付き合うために\nたっぷり\n食べておかないと♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100602, 249, 8, "この楽譜\nサックスで吹いて\nみたいなぁ♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100701, 251, 1, "プリン、プリン、\nプリン、プリン、\nプリン、プリン～♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100701, 252, 2, "う～ら～め～し～や～\nなの～♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100701, 253, 3, "プリンがないなら\n死んだほうがマシなの\nあ、もう死んでたの～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100701, 254, 4, "幽霊の正体見たり、\nミヤコなの～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100701, 255, 5, "ミヤコがいきなり\n消えたら、みんな\n驚くかもなの～♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100701, 256, 101, "アイツがいて、\nプリンもある。\nきっとここが天国なの", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100701, 257, 102, "アイツはプリンセス\nナイトじゃなくて\nプリンナイトなの～", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100701, 258, 1, "姿を消して、オマエを\n見張ってやるの～\nむふふ～♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100701, 259, 2, "もし成仏した先に\nプリンがなかったら\n地獄なの～…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100701, 260, 3, "右にプリン左にプリン\n後ろにもプリン♪\n前にはオマエなの～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100701, 261, 4, "死んだ人には\nお供え物をするの～\nミヤコにも、プリンを\n毎日お供えするの～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100701, 262, 101, "たくさんオマエと\n遊べて、\n成仏しそうなくらい\nうれしいの～！", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100701, 263, 102, "オマエのこと\n気に入ったからずっと\nとり憑いてやるの～", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 100701, 264, 1, "う～　眠いの…\n二度目の二度寝を\nするの…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 100701, 265, 2, "お昼ご飯はプリンなの\n３時のおやつも、\nプリンなの～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 100701, 266, 3, "ディナーは豪華に、\nプリンのフルコース\nなの～♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100701, 267, 1, "体が透けちゃうから\nうまく使えないの～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100701, 268, 2, "まったりなの～\nあとはプリンがあれば\n完璧なの～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100701, 269, 3, "む～…かわいいけど\nプリンは分けて\nあげないの～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100701, 270, 4, "は～　いい気分なの…\n成仏しそうなの…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100701, 271, 5, "も、もしかして\nミヤコ、ここで\n火葬されちゃうの？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100701, 272, 6, "幽霊には、体力も\n筋力も関係ないの～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100701, 273, 7, "ぱくぱくモグモグ…\nミヤコ、幽霊だけど、\nお腹はすくの～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100701, 274, 8, "プリンの写真集が\nあればいいのに\nなの～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100702, 276, 1, "うらめしや～…\n裏の飯より\nプリンがいいの～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100702, 277, 2, "プリン♪　プリン♪\nプリン♪　なの～♪　", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100702, 278, 3, "世界中のケーキ屋が\nプリンのおいしさを\n競い合えばいいの～！\n審査員はミヤコなの～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100702, 279, 4, "買ってきたプリンには\n全部ミヤコの名前を\n書いておくの～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100702, 280, 5, "プリンがないなら\n死んだほうがマシなの\nあ、もう死んでたの～ ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100702, 281, 101, "アイツがいて\nプリンもある\nきっとここが天国なの", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100702, 282, 102, "アイツはプリンセス\nナイトじゃなくて\nプリンナイトなの～", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100702, 283, 1, "右にプリン左にプリン\n後ろにもプリン♪\n前にはオマエなの～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100702, 284, 2, "もし成仏した先に\nプリンがなかったら\n地獄なの～…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100702, 285, 3, "今日はオマエと\nプリンを買いに行くの\n強制なの～　", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100702, 286, 4, "死んだ人には\nお供え物をするの～\nミヤコにも、プリンを\n毎日お供えするの～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100702, 287, 101, "たくさんオマエと\n遊べて\n成仏しそうなくらい\nうれしいの～！ ", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100702, 288, 102, "ミヤコのプリン\nオマエにだったら\n分けてあげるの～ ", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 100702, 289, 1, "う～　眠いの…\n二度目の二度寝を\nするの… ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 100702, 290, 2, "う～ら～め～し～や～\n…明るい時間だと\n驚かせないの～ ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 100702, 291, 3, "ひゅ～どろどろ～ん☆\n真っ暗なうちに\nいたずらしまくるの～♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100702, 292, 1, "体が透けちゃうから\nうまく使えないの～ ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100702, 293, 2, "落ち着くの～\nいまプリン食べたら\nきっといつもより\nおいしいの～♪ ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100702, 294, 3, "む～…かわいいけど\nプリンは分けて\nあげないの～　", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100702, 295, 4, "は～　いい気分なの…\n成仏しそうなの…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100702, 296, 5, "も、もしかして\nミヤコ、ここで\n火葬されちゃうの？ ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100702, 297, 6, "幽霊には、体力も\n筋力も関係ないの～！　", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100702, 298, 7, "おいしいの～\nプリン味だったら\nもっとおいしいの～ ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100702, 299, 8, "プリンの写真集が\nあればいいのに\nなの～ ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100801, 301, 1, "もし太陽が滅んでも\nボクの美しさで大地を\n照らしてあげる！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100801, 302, 2, "う～ん、この部屋には\nボクの肖像画や\n彫像が必要だね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100801, 303, 3, "美の女神と愛の女神が\nボクを作る時、本気\n出しちゃったんだね♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100801, 304, 4, "ボクの誕生とともに\n全ての美しさは過去の\n遺物になったんだよ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100801, 305, 5, "うわっ昨日より可愛く\nなってる。明日は\nどうなっちゃう\nのかな？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100801, 306, 101, "このボクがいるだけで\nあの人への\nおもてなしだよね", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100801, 307, 102, "ボクの可愛さは、\nふふ…あの人の\nためのものさ", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100801, 308, 1, "ねぇ～、ボクって\n可愛い？\nふふ、知ってる☆", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100801, 309, 2, "呼んだ？\n可愛いボクと話したい\n気持ちはわかるよ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100801, 310, 3, "ふふ、ボクに触ると\nキミも美しく\nなっちゃうかもよ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100801, 311, 4, "どうかな、\n今日のボク。\n美しい？　可愛い？\nねえ、どっち？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100801, 312, 101, "あの人も今、\n可愛いボクのこと\n考えてるかな…", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100801, 313, 102, "美しい…\nキミの瞳に写るボクは\nより一層きれいだ", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 100801, 314, 1, "美しいボクの\n美しい一日が\n始まるよ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 100801, 315, 2, "さーて、午後からも\n可愛く美しく\n華麗に優雅に♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 100801, 316, 3, "バラの花びら\nいっぱい浮かべた\nお風呂に入ってから\n寝ようっと♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100801, 317, 1, "鏡よ、鏡。この世で\n一番可愛いボクに\nお似合いの人はだれ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100801, 318, 2, "ボクが座ったソファは\n「美しいソファ」に\nランクアップした！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100801, 319, 3, "わあ、可愛い！\n…まあ、ボクほど\nじゃないけどさ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100801, 320, 4, "服を羽織るように\n香りをまとうボク…\n美しい、美しすぎる！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100801, 321, 5, "気安く触ったら\n火傷する…\n炎はボクに似ているね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100801, 322, 6, "運動は苦手なのに\n運動するボクの姿は\n可愛いなんて…罪♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100801, 323, 7, "ボクが食べると、\n食べ物まで\n可愛いなあ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100801, 324, 8, "ボクが触った瞬間に、\nこの本は美を\n携えてしまうんだ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100802, 326, 1, "ボクの美しさは\nみんなのために\nあるんだよ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100802, 327, 2, "う～ん、この部屋には\nボクの肖像画や\n彫像が必要だね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100802, 328, 3, "これ以上美しくなると\nボクをめぐって\n大陸中で戦争が\n始まっちゃう！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100802, 329, 4, "ボクの誕生とともに\n全ての美しさは過去の\n遺物になったんだよ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100802, 330, 5, "ボクの可愛さについて\nみんな話し合わない\nのかな…？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100802, 331, 101, "このボクがいるだけで\nあの人への\nおもてなしだよね", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100802, 332, 102, "あの人も今\n可愛いボクのこと\n考えてるかな…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100802, 333, 1, "美の女神と愛の女神が\nボクを作る時、本気\n出しちゃったんだね♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100802, 334, 2, "ボクの美しさに嫉妬\nしたって意味ないよね\n次元が違うんだから", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100802, 335, 3, "ボクの化粧品使う？\n一緒に可愛くなろうよ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100802, 336, 4, "ボクがいるだけで\nこの部屋は美の神殿♪\nランドソルの新たな\n観光名所になるね！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100802, 337, 101, "呼んだ？\n可愛いボクと話したい\n気持ちはわかるよ", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100802, 338, 102, "美しい…\nキミの瞳に写るボクは\nより一層綺麗だ", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 100802, 339, 1, "朝日と共に\nボクの美しさも\n周りを照らすよ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 100802, 340, 2, "ボクの美しさを\n維持するために\nお昼ご飯食べなくちゃ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 100802, 341, 3, "バラの花びらいっぱい\n浮かべたお風呂に\n入ってから\n寝ようっと♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100802, 342, 1, "鏡よ、鏡。この世で\n一番可愛いボクに\nお似合いの人はだれ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100802, 343, 2, "ボクが座ったソファは\n「美しいソファ」に\nランクアップした！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100802, 344, 3, "可愛いものを\n可愛いって言える\nボクって可愛いよね！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100802, 345, 4, "服を羽織るように\n香りをまとうボク…\n美しい、美しすぎる！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100802, 346, 5, "冷えは美容の大敵\nなんだから！\nここ、ボクの場所ね！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100802, 347, 6, "運動は苦手なのに\n運動するボクの姿は\n可愛いなんて…罪♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100802, 348, 7, "ボクが食べると\n食べ物まで\n可愛いなあ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100802, 349, 8, "ボクが触った瞬間に\nこの本は美を\n携えてしまうんだ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100901, 351, 1, "「第１０部２０章\n終焉戦争、開幕」\n…これでよし！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100901, 352, 2, "今度シグルドに\n私の魔法を一つ\n伝授してやるか", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100901, 353, 3, "ここでは風が\n吹いてこないな…\n換気したい！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100901, 354, 4, "そうだ、ナナカに\nこの間借りた本を\n返さないと…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100901, 355, 5, "まずは包帯をとって\n手から龍の形の\n炎を出して…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100901, 356, 101, "シグルド…\n今頃何処で何を\nしているのだろう…", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100901, 357, 102, "最近、彼の姿が\nまぶしく見える…\nどうして…？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100901, 358, 1, "辞書を知らないか？\n…探している\n理由は聞くな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100901, 359, 2, "そうだ！\n貴様の技にも\n名前をつけてやろう！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100901, 360, 3, "私に触れても力を\n奪われないのは\n貴様くらいだぞ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100901, 361, 4, "何事だ？\nまさか我が瞳に\n魅入られたのか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100901, 362, 101, "貴様がそばにいると\nとても安心できる…\n…不思議だ", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100901, 363, 102, "い、いきなり目の前に\n現れるな！　ドキドキ\nするだろうがぁ！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 100901, 364, 1, "「覚醒」めたか…\n行くぞ、悪を討つ\n戦いに出発だ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 100901, 365, 2, "昼間は「ヤツら」も\n襲ってはこない…\n束の間の休息だ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 100901, 366, 3, "どうした？　夜はまだ\nこれから…ふぁ…\nね、眠くなどないぞ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100901, 367, 1, "何か足りないな…\n暗黒騎士の紋章を\n作ろうかな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100901, 368, 2, "くっ…！\n私を眠りの国へ\n誘うつもりか！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100901, 369, 3, "このようなものに\n懐柔されるものか！\n…されるものか！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100901, 370, 4, "これを使えば\nもっとそれっぽい\n雰囲気が出そうだ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100901, 371, 5, "これが我らの求めた\n安寧か…\n悪くない…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100901, 372, 6, "この程度\n前世での激闘に\n比べれば…！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100901, 373, 7, "最近金欠でな…\nいやぁありがたい…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100901, 374, 8, "ここにも\n前世の記憶が\n眠っていたとは…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100902, 376, 1, "「第１３部１章\n閃光のシグルド」\n…ついに登場だな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100902, 377, 2, "何故だ…何故\nこうもあっさり金欠に\n逆戻りするのだ！？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100902, 378, 3, "やはり転生者という\n設定はカッコイイ…\n天才だな、私！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100902, 379, 4, "そうだ、ナナカに\nこの間借りた本を\n返さないと…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100902, 380, 5, "そろそろ今日の分の\n魔力を溜めないと\nまた魔力切れが…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100902, 381, 101, "最近奴がそばに\nいるだけで、鼓動が\n早くなるのは何故だ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 100902, 382, 102, "シ、シグルド…！\nだめだ…妄想でも\n上手く言えない…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100902, 383, 1, "なんだ？　新たな\n賞金の情報を\n持ってきたのか？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100902, 384, 2, "名乗りやポーズは\nその強度で相手を\n圧倒する技術だ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100902, 385, 3, "いいか、魔法の\n詠唱中は絶対に\n声をかけるなよ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100902, 386, 4, "おお、ちょうど今\n貴様専用の設定集を\n作成中だぞ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100902, 387, 101, "貴様がそばにいると\nとても安心できる…\n…不思議だ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 100902, 388, 102, "い、いきなり目の前に\n現れるな！　ドキドキ\nするだろうがぁ！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 100902, 389, 1, "夜更かしのせいか\nまだ眠気が…いや！\nこれは組織の罠だ！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 100902, 390, 2, "平穏な時に\n出来るだけ魔力を\n溜めておかねば…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 100902, 391, 3, "夜になると、力が\n増した気分になるな\n…なりませんか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100902, 392, 1, "何か足りないな…\n暗黒騎士の紋章を\n作ろうかな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100902, 393, 2, "お、おのれ\nヒュプノス…\n私は負けないぞ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100902, 394, 3, "くっくっくっ…\n貴様は特別団員に\nしてやろう", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100902, 395, 4, "これを使えば\nもっとそれっぽい\n雰囲気が出そうだ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100902, 396, 5, "これが我らの求めた\n安寧か…\n悪くない…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100902, 397, 6, "新たな戦いに備えて\n魔力だけでなく\n体力も鍛えねば！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100902, 398, 7, "食事は魔力に\n変換する体力の\n元になるのだ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 100902, 399, 8, "フフフ…\nこれを覚えれば\nもっと強く…！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101001, 401, 1, "王子はんほんまに\nはんなりしてて、\n王子はんって感じやわ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101001, 402, 2, "この絵本の王子はん、\n王子はんみたいで\nええなぁ♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101001, 403, 3, "うちがガラスの靴を\n落としたら、王子はん\n見つけてくれるやろか", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101001, 404, 4, "マホマホ王国\n次期国王の王子はん\n…見てみたいわ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101001, 405, 5, "王子はんのために\n糸を紡いで、\n編み物でもしまひょか", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101001, 406, 101, "マホ姫と王子はん、\n絵本の世界より\nベストカップルや", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101001, 407, 102, "王子はんと\n一緒にいると\n胸がせわしのー\nうごいてかなん", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101001, 408, 1, "うちら並んでたら\nお雛様みたいに\n見えると思いまへん？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101001, 409, 2, "王子はんを\n国に連れて帰ったら\nみんな大歓迎して\nくれるやろなぁ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101001, 410, 3, "王子はんは、\n絵本から出てきた人\nみたいやね～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101001, 411, 4, "うちの話し方\nのんびりしてます\nやろか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101001, 412, 101, "マホ姫の手は\nつべたいから、\n王子はんが温めて？", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101001, 413, 102, "うちがもし悪い魔法に\nかかったら、王子はん\n口づけしてくれはる？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 101001, 414, 1, "朝は小鳥はんも\nおなかがすいてるから\nよう飛び回りはるねえ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 101001, 415, 2, "お茶請けはお大福が\nよろしおすけど\nクッキーもええなあ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 101001, 416, 3, "うち、普段から\n夢見がちやけど…\nほんに眠い時間やわぁ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101001, 417, 1, "王子はんに\n会いに行くなら、\nおめかしせな\nあかんなぁ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101001, 418, 2, "はんなりした\nええお椅子やわぁ\nほっこりしますなあ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101001, 419, 3, "かいらしもんが\nいっぱいで、\nマホマホ王国みたい\nやわぁ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101001, 420, 4, "心地ええどす。まるで\nお花畑にいるようやね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101001, 421, 5, "ぽかぽかどす。\n心まであったかく\nなりますわぁ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101001, 422, 6, "はぁはぁ、お姫はんは\n激しい運動は\nしぃひんもんどす～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101001, 423, 7, "もぐもぐ…あんまり\n速う食べられへんけど\n美味しいわぁ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101001, 424, 8, "絵本、絵本～\n幸せやわぁ♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101002, 426, 1, "王子はんにとって\n自慢の姫になるえ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101002, 427, 2, "カボチャの馬車に\nガラスの靴…\n欲しいなぁ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101002, 428, 3, "うちがガラスの靴を\n落としたら、王子はん\n見つけてくれるやろか", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101002, 429, 4, "マホマホ王国\n次期国王の王子はん\n…見てみたいわ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101002, 430, 5, "ほんまなぁ\nこの絵本が面白いんよ\n王子はんに\n読んであげよ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101002, 431, 101, "マホ姫と王子はん\n絵本の世界より\nベストカップルや", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101002, 432, 102, "王子はんと\n一緒にいると\n胸がせわしのー\nうごいてかなん", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101002, 433, 1, "たまには、王子はんの\n好きな絵本も\n知りたいな～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101002, 434, 2, "王子はんを\n国に連れて帰ったら\nみんな大歓迎して\nくれるやろなぁ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101002, 435, 3, "そのうち、王子はんの\nお国にも連れてって\nもらえますやろか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101002, 436, 4, "絵本読むんも\nええなぁ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101002, 437, 101, "うちがもし悪い魔法に\nかかったら、王子はん\n口づけしてくれはる？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101002, 438, 102, "うちら並んでたら\nお雛様みたいに\n見えると思いまへん？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 101002, 439, 1, "朝は小鳥はんも\nおなかがすいてるから\nよう飛び回りはるねえ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 101002, 440, 2, "マホマホ王国では\nこの時分は\nみんなお昼寝\nしてたんよ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 101002, 441, 3, "夜に飛んだり鳴いたり\nする鳥はんもおるんよ\n昼は寝てはるんかねぇ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101002, 442, 1, "王子はんに\n会いに行くなら\nおめかしせな\nあかんなぁ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101002, 443, 2, "王子はんも一緒に\nゆっくりしていっても\nええんよ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101002, 444, 3, "かいらしい子やねぇ\nうちとお友だちに\nなってくれるん？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101002, 445, 4, "癒しアイテムって\nほんま、好っきゃわぁ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101002, 446, 5, "うちのお城にも\nほしいわぁ。帰ったら\nさっそく準備せな\nあかんなぁ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101002, 447, 6, "部屋の中で運動\nできるのも、なかなか\n面白いもんやわぁ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101002, 448, 7, "おいひいわ～\nマホマホ王国には\nない味やわぁ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101002, 449, 8, "しっかり知識を\n身につけんと\n魔法も使えへん\nからなぁ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101101, 451, 1, "１、２、３、４…\nあれ？　いま、\n何段目まで\n編んだっけ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101101, 452, 2, "おやつのケーキは\n苺かチョコ…\nどっちも食べよう！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101101, 453, 3, "い、いけない！\n縫い針落としちゃった", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101101, 454, 4, "ケーキをクレープで\n巻いたら…\n大ヒット商品の予感！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101101, 455, 5, "「どうだ！妹暮らし」\nってことわざ\nなかったっけ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101101, 456, 101, "お兄ちゃんに、\nお洋服でも\n作ろうかな？", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101101, 457, 102, "ここがお兄ちゃんの\n部屋…\nドキドキしちゃう～", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101101, 458, 1, "ねぇ、おにいちゃん\n一緒に、スイーツでも\n食べにいかない？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101101, 459, 2, "クリームついてた！？\nさっき食べた、\nケーキかも…！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101101, 460, 3, "勉強、見てくれるん\nですか？　やった～♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101101, 461, 4, "服がほつれてますよ？\n直してあげます！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101101, 462, 101, "私をお嫁さんに\nしたいなら、予約は\nお早目に、ですよ♪", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101101, 463, 102, "ねぇねぇお兄ちゃん！\n…えへへ、\n呼んでみただけ♪", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 101101, 464, 1, "今日も１日\n勉強がんばります！\n…少しは遊ぼうかな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 101101, 465, 2, "お昼休憩に\n甘いものが\n食べたいです～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 101101, 466, 3, "ねむいです～\nでももうちょっと\n勉強しないと～…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101101, 467, 1, "この服、かわいい♪\n今度作って\nみよっと～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101101, 468, 2, "勉強で疲れたから\n休憩しよ～っと", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101101, 469, 3, "かわいい♪\n私が服を作って\nあげよっか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101101, 470, 4, "リラックスできます～\nお兄ちゃんが隣に\nいるみたい！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101101, 471, 5, "のんびりしたら、\nまた勉強しよっと！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101101, 472, 6, "運動すると勉強も\nはかどるよね！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101101, 473, 7, "おいし～！\nお兄ちゃんにも\nおすそ上げしますね！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101101, 474, 8, "お兄ちゃんの記憶を\n戻す方法、どこかに\n書いてないかな？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101102, 476, 1, "ケーキの食べ過ぎで\nお腹が…うぅ、\n因果横暴だよー…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101102, 477, 2, "１、２、３、４…\nあれ？　いま、\n何段目まで\n編んだっけ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101102, 478, 3, "い、いけない！\n縫い針落としちゃった", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101102, 479, 4, "笑う時には服着ます！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101102, 480, 5, "「どうだ！妹暮らし」\nってことわざ\nなかったっけ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101102, 481, 101, "お兄ちゃんに、\nお洋服でも\n作ろうかな？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101102, 482, 102, "お兄ちゃんが帰って\nきたら、何して遊ぼう\nかな～？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101102, 483, 1, "勉強、見てくれるん\nですか？　やった～♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101102, 484, 2, "クリームついてた！？\nさっき食べた、\nケーキかも…！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101102, 485, 3, "おにいちゃん！\nそろそろ、おやつに\nしませんか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101102, 486, 4, "勉強は…\n明日にしようっと", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101102, 487, 101, "妹だけど、大人な\nレディですからね！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101102, 488, 102, "な、ナデナデとか\n恥ずかしいな～", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 101102, 489, 1, "今日も１日\n勉強がんばります！\n…少しは遊ぼうかな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 101102, 490, 2, "お昼休憩に\n甘いものが\n食べたいです～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 101102, 491, 3, "お兄ちゃんは\n夜強いんですね\n私は眠くて…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101102, 492, 1, "服装や髪形が変わると\n気分も変わるよね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101102, 493, 2, "ここで寝ちゃったら\n受験勉強が～…\nぐーー", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101102, 494, 3, "かわいい♪\n私が服を作って\nあげよっか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101102, 495, 4, "いまならどんな試験も\n合格できそうです！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101102, 496, 5, "のんびりしたら\nまた勉強しよっと！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101102, 497, 6, "お兄ちゃんを\n守るためには\n毎日、鍛えなくちゃ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101102, 498, 7, "おいし～！\nお兄ちゃんにも\nおすそ上げしますね！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101102, 499, 8, "この本の服\nかわいいなぁ♪\n私に作れるかな？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101201, 501, 1, "う～ん、今なら\nどこでだって\n眠れちゃいそう…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101201, 502, 2, "たくさん寝すぎて、\n夢の中か現実か\nわかんなく\nなっちゃうんだよね～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101201, 503, 3, "…はっ！？\nね、寝てないよ？\nホントだよっ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101201, 504, 4, "ぐっすり眠って\nパワーを\nフルチャージっ☆", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101201, 505, 5, "もし、超能力のことが\nバレたら…ブルブル", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101201, 506, 101, "テレパシーで\nキミの心を覗けたら\n…なんてね！", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101201, 507, 102, "キミを抱き枕に…\nじょ、冗談冗談！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101201, 508, 1, "ん～、なになに？\n一緒にお昼寝する？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101201, 509, 2, "忘れ物しちゃった。\nま、いっか！\nえ、ダメ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101201, 510, 3, "おおっ、相談ごと？\nなにかな\nなにかな～？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101201, 511, 4, "う～ん、もしかして\nキミにも仲良しになる\n超能力があるのかも！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101201, 512, 101, "むむ～…どう？\nテレパシーで、私の\n気持ちを送ったよ！", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101201, 513, 102, "えっ？　私とキミとの\n相性？　むむ～…\nうん、バッチリだよ☆", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 101201, 514, 1, "まだこんな時間？\nベッドに行って、\n二度寝しなくちゃ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 101201, 515, 2, "適度なお昼寝は\n健康にいいんだって！\n８時間くらいかな？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 101201, 516, 3, "どんなにお昼寝しても\n夜は眠いんだ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101201, 517, 1, "ん～、また寝癖…\nいっつも\n寝てるからかなぁ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101201, 518, 2, "一休み、一休み…\nどうせなら百休み\nくらいしようかな…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101201, 519, 3, "これ…可愛い！\nシオリンに\n届けてあげたい！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101201, 520, 4, "ん～…気分爽快！\nそれじゃ、おやすみ～\n…すやぁ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101201, 521, 5, "気持ちいい…\nはっ！　ダメダメ！\nまた寝るとこだった！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101201, 522, 6, "眠くならないように、\n運動しよっと！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101201, 523, 7, "お腹いっぱいになると\n眠くなるよね～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101201, 524, 8, "睡眠学習って\n本を読みながら\n寝るんだっけ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101202, 526, 1, "う～ん、今なら\nどこでだって\n眠れちゃいそう…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101202, 527, 2, "もっといっぱい\n超能力使えたら\nいいのにな～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101202, 528, 3, "ねえねえ、\n今から人助け、\n付き合ってほしいなー", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101202, 529, 4, "ぐっすり眠って\nパワーを\nフルチャージっ☆", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101202, 530, 5, "人助け、頑張ったら\nなんだか、眠く…\n…はっ、ダメダメ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101202, 531, 101, "キミと一緒なら、\nなんだって出来る！\n間違いない！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101202, 532, 102, "キミを抱き枕に…\nじょ、冗談冗談！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101202, 533, 1, "忘れ物しちゃった\nま、いっか！\nえ、ダメ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101202, 534, 2, "なに？　困ってる？\nちょうど良かった！\n今は体力満タンだよ☆", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101202, 535, 3, "一緒に\nお出かけしたいなー\nデートしよっ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101202, 536, 4, "うんうん、そうだねっ\n困ってる人がいたら\n見過ごせないよねっ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101202, 537, 101, "むむ～…どう？\nテレパシーで、私の\n気持ちを送ったよ！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101202, 538, 102, "う～だんだん眠く…\nねぇ一緒に寝よ？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 101202, 539, 1, "キミって早起きだね！\n私は寝ようかな～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 101202, 540, 2, "適度なお昼寝は\n健康にいいんだって！\n８時間くらいかな？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 101202, 541, 3, "どんなにお昼寝しても\n夜は眠いんだ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101202, 542, 1, "ん～、また寝癖…\nいっつも\n寝てるからかなぁ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101202, 543, 2, "一休み、一休み…\nどうせなら百休み\nくらいしようかな…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101202, 544, 3, "これ…可愛い！\nシオリンに\n届けてあげたい！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101202, 545, 4, "ん～…気分爽快！\nそれじゃ、おやすみ～\n…すやぁ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101202, 546, 5, "うう～ん、なんだか\nいつもより眠ーく\nなってきたよ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101202, 547, 6, "よーし\n困ってる人のために\nパワーアップ☆", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101202, 548, 7, "食べてすぐ寝ると\n牛になるんだっけ？\nまぁ、いいかぁ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101202, 549, 8, "睡眠学習って\n本を読みながら\n寝るんだっけ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101601, 551, 1, "モデルは楽しいよ！\nファンの子みんな\n応援してくれるしー！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101601, 552, 2, "今日のおやつは\n駄菓子に決定～！\nいただきまーす！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101601, 553, 3, "んー、今日のおやつは\n何にしよう？\nやっぱアメ玉かな！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101601, 554, 4, "ここで撮影会、\nしようかな～♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101601, 555, 5, "７かける８はぁ\n７＋７＋７＋７＋…\nん、何個数えたっけ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101601, 556, 101, "やば…\nこのままじゃ、うち\nキュン死にかも…", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101601, 557, 102, "好きなことして\nヒデサイもいて\nうちって超～\nリア充だよね♪", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101601, 558, 1, "うちの写真撮るの？\nどんなポーズ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101601, 559, 2, "ネイルの勉強中～♪\nうまくなったら、\nヒデサイにしてあげる", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101601, 560, 3, "宿題見てくんない？\nひとりじゃムリ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101601, 561, 4, "みてこのネイル♪\n超エモくな～い？\nヒデサイもする～？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101601, 562, 101, "新しい美容液で\n肌まじスベスベ～\nヒデサイも\n触ってみる？", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101601, 563, 102, "ヒデサイと会ってると\n顔熱くなるんだよね\n熱なんかないのに…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 101601, 564, 1, "早起きとか\nつらたんだよねー\n昼すぎまで寝てたい", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 101601, 565, 2, "撮影にむけて\nダイエットちうだから\nお昼ぬいてるんだー", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 101601, 566, 3, "お腹すいたー\nでもこの時間に\n食べたら絶対に\n太るやつだよねー", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101601, 567, 1, "どんなシーンにも合う\nきれいめわがまま\nちゃんとコーデだよ♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101601, 568, 2, "ちょっち疲れたかも？\nガン寝しちゃおっかな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101601, 569, 3, "きゃわたーん☆\n君もおしゃれしよっか", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101601, 570, 4, "いいにおいじゃん！\nこれと同じにおいの\n香水ないかな？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101601, 571, 5, "あったまるー\nこれ、サイツヨに\n癒しじゃない？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101601, 572, 6, "あはは、なんか\nウォーキングの練習\nしてるみたーい！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101601, 573, 7, "体形維持しないと\nいけないけど\nついつい食べちゃう！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101601, 574, 8, "全然読めない～\nそだ、ヒデサイに\n読んでもらおっと！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101602, 576, 1, "そろそろ\n仕事の時間だ～\n出かける準備\nしよっと！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101602, 577, 2, "今日のおやつは\n駄菓子に決定～！\nいただきまーす！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101602, 578, 3, "ヒデサイを見習って\nうちも少し勉強して\nみよっかな…　", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101602, 579, 4, "体形維持とか\n気にしてるんだよ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101602, 580, 5, "７かける８はぁ\n７＋７＋７＋７＋…\nん、何個数えたっけ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101602, 581, 101, "やば…\nこのままじゃ、うち\nキュン死にかも…　", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101602, 582, 102, "ヒデサイと会ってると\n顔熱くなるんだよね\n熱なんかないのに…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101602, 583, 1, "うちの写真撮るの？\nどんなポーズ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101602, 584, 2, "ネイルの勉強中～♪\nうまくなったら、\nヒデサイに\nしてあげる♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101602, 585, 3, "この雑誌の服\nガチめにほしぃ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101602, 586, 4, "うちのコーデで\nヒデサイをオシャンに\nしてあげるね♪", 1);
