INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 101602, 589, 1, "今日は早起き\nできたんだー\nメイクもばっち\nきまってるっしょ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 101602, 590, 2, "撮影にむけて\nダイエットちうだから\nお昼ぬいてるんだー", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 101602, 591, 3, "お腹すいたー\nでもこの時間に\n食べたら絶対に\n太るやつだよねー", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101602, 592, 1, "この服ね～\n今年のトレンドなんだ♪\nかわたんでしょ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101602, 593, 2, "ちょっち疲れたかも？\nガン寝しちゃおっかな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101602, 594, 3, "うわー\nこのぬいぐるみ\nもきゅすぎでしょ～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101602, 595, 4, "いいにおーい♪\nファンのみんなにも\n教えてあげよー♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101602, 596, 5, "あったまるー\nこれ、サイツヨに\n癒しじゃない？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101602, 597, 6, "食べた分は\n消費しないとね～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101602, 598, 7, "体形維持しないと\nいけないけど\nついつい食べちゃう！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101602, 599, 8, "全然読めない～\nそだ、ヒデサイに\n読んでもらおっと！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101701, 601, 1, "やっさー\n踊ってると、どんどん\n楽しくなるさー！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101701, 602, 2, "このお菓子、でーじ\nおいしいねー！\nキミも食べる？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101701, 603, 3, "ハイターイ！　元気な\nあいさつが一番さ～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101701, 604, 4, "あまった食材があれば\nチャンプルーにして\n食べたいさー！ ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101701, 605, 5, "さぁ、みんなで歌って\n踊るさ～♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101701, 606, 101, "毎日、最高に幸せさ～\nキミのおかげだねー", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101701, 607, 102, "キミへの気持ちを\n踊りで表現\nしてみるさ～", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101701, 608, 1, "海でひと泳ぎ\nしたいさ～\nキミもどう？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101701, 609, 2, "あぎひゃっ！\n急に声かけたら、\nビックリするさ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101701, 610, 3, "踊りなら、\n私が手とり足とり\n教えてあげるさ～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101701, 611, 4, "空手の型の\n練習するさー\nキミもどう？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101701, 612, 101, "よ～し、手をつないで\n踊るさ～！\n恥ずかしがること\nないさ～", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101701, 613, 102, "キミと一緒だから、\n毎日楽しいこと\nばっかりさー", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 101701, 614, 1, "ハイターイ！\n今日も一日、\nがんばるさー！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 101701, 615, 2, "午後も頑張るために\nお昼ご飯は\nてびちにするさー！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 101701, 616, 3, "故郷では見えない星が\n見られるんだねえ。\nなんか不思議さぁ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101701, 617, 1, "夢中で踊ってたら、\n髪の毛ぼさぼさに\nなってるさ～！？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101701, 618, 2, "よく食べてよく踊って\nよく休む。\nそれが元気の秘訣さ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101701, 619, 3, "ちゅらかーぎーねー！\nキミはどこから\n来たのー？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101701, 620, 4, "いい香り～、って\n私もカオリだったさ！\nなんだか照れるね☆", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101701, 621, 5, "故郷はあんまり暖房を\n使わなかったから、\n新鮮さー！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101701, 622, 6, "汗をかくのは\n気持ちいいさー！\nどんどん行くよー！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101701, 623, 7, "うーん、おいしいさ～\nゴーヤっぽいものを\n混ぜたいさ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101701, 624, 8, "おおー、故郷の民話！\nこんなとこで見るとは\n懐かしいさぁ～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101702, 626, 1, "焦らなくても\nなんくるないさ～\nなるようになるさ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101702, 627, 2, "さぁ、みんなで歌って\n踊るさ～♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101702, 628, 3, "元気がないときは\n私のところに来るさー", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101702, 629, 4, "あまった食材があれば\nチャンプルーにして\n食べたいさー！ ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101702, 630, 5, "ノリノリな音楽と\n踊りで、疲れを\n吹き飛ばすさ～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101702, 631, 101, "毎日、最高に幸せさ～\nキミのおかげだねー", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101702, 632, 102, "幸せすぎて踊らずには\nいられないさ～", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101702, 633, 1, "海でひと泳ぎ\nしたいさ～\nキミもどう？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101702, 634, 2, "ん？　どうしたの～？\nヒマなら一緒に\n踊ろうさ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101702, 635, 3, "キミと一緒だから\n毎日楽しいこと\nばっかりさー", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101702, 636, 4, "ハイターイ！　元気な\nあいさつが一番さ～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101702, 637, 101, "キミと踊ってる時が\n一番幸せさ～\nキミもそう思ってたら\nうれしいさ～", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101702, 638, 102, "海に沈む夕日は\nとっても綺麗さ～！\n今度一緒に見ようね～ ", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 101702, 639, 1, "気持ちのいい朝さー！\nひとっ走り\nしてくるさー！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 101702, 640, 2, "午後も頑張るために\nお昼ご飯は\nてびちにするさー！ ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 101702, 641, 3, "故郷では見えない星が\n見られるんだねえ\nなんか不思議さぁ ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101702, 642, 1, "夢中で踊ってたら\n髪の毛ぼさぼさに\nなってるさ～！？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101702, 643, 2, "よく食べてよく踊って\nよく休む\nそれが元気の秘訣さ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101702, 644, 3, "ちゅらかーぎーねー！\nキミはどこから\n来たのー？ ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101702, 645, 4, "いい香り～、って\n私もカオリだったさ！\nなんだか照れるね☆ ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101702, 646, 5, "故郷はあんまり暖房を\n使わなかったから\n新鮮さー！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101702, 647, 6, "徹夜で踊り続ける\nためにも、まずは\n体を鍛えるさ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101702, 648, 7, "もぐもぐ…もっと\nおかわりがほしいさー", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101702, 649, 8, "おおー、故郷の民話！\nこんなとこで見るとは\n懐かしいさぁ～！ ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101801, 651, 1, "はあ…\nすてきな小説だった～\nキュンキュンしちゃう", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101801, 652, 2, "このお部屋\n女の子ばかりね。\n魔族の女子校を\n思い出しちゃう♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101801, 653, 3, "次のテスト\n恋愛小説から\n出題したら\nダメかしら…？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101801, 654, 4, "キンコンカンコ～ン♪\n授業をはじめま～す", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101801, 655, 5, "はー…\nちょっと肩が\nこっちゃった…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101801, 656, 101, "私、あの子のこと\n無意識に特別扱い\nしちゃってるかな…", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101801, 657, 102, "物語だと生徒が先生を\n好きになるのにな…\n逆の場合は…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101801, 658, 1, "あん！　見ちゃダメよ\n明日のテストの問題を\n作ってるとこなの！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101801, 659, 2, "勉強勉強で\n疲れたよね？\n膝枕してあげる！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101801, 660, 3, "テストがんばったね～\nご褒美に先生が\n特別な授業\nしてあげるね？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101801, 661, 4, "学院の外でも\n私は君の先生よ\nなんでも聞いてね♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101801, 662, 101, "今読んでるのは\nヒロインが年下の子と\n恋に落ちる話…あ、\n深い意味はないのよ～", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101801, 663, 102, "生徒は全員可愛いけど\n君は少し特別…\nみんなには内緒よ？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 101801, 664, 1, "学校に\n遅刻しないように\n早く準備しないとね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 101801, 665, 2, "男の子といっしょに\nお弁当を食べるの、\n夢なんだ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 101801, 666, 3, "明日の予習はやった？\n先生も手伝うから\n寝る前にやりましょ♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101801, 667, 1, "もしかして…\n少し露出多いかしら？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101801, 668, 2, "リラックスすると\nα波が出て、勉強が\nはかどるんですって", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101801, 669, 3, "かわいい♪　あなたも\n私の生徒になる？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101801, 670, 4, "学院にもこういう\n安らぐ設備が\n必要かしらね？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101801, 671, 5, "まだ寒いわぁ\n誰か隣に\n来てくれたら…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101801, 672, 6, "運動部の顧問も\nできるかしら？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101801, 673, 7, "学校の給食でも\n食べたいわぁ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101801, 674, 8, "いい参考書を\n見つけちゃった♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101802, 676, 1, "私の生徒に\n不良なんていないわ\nみーんないい子♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101802, 677, 2, "このお部屋\n女の子ばかりね\n魔族の女子校を\n思い出しちゃう♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101802, 678, 3, "あの子、まだかな…\n宿題も見てあげたいし\n早く来ないかしら？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101802, 679, 4, "はあ…\nすてきな小説だった～\nキュンキュンしちゃう", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101802, 680, 5, "学校の図書室に\n恋愛小説を\n置いて欲しいなあ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101802, 681, 101, "私、あの子のこと\n無意識に特別扱い\nしちゃってるかな…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 101802, 682, 102, "物語だと生徒が先生を\n好きになるのにな…\n逆の場合は…　", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101802, 683, 1, "あん！　見ちゃダメよ\n明日のテストの問題を\n作ってるとこなの！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101802, 684, 2, "勉強勉強で\n疲れたよね？\n膝枕してあげる！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101802, 685, 3, "宿題はもうやった？\n苦手なところは\n先生が見てあげる♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101802, 686, 4, "んん？　なんだか\n元気がないみたい\n先生がぎゅぅ～って\nしてあげる…　", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101802, 687, 101, "君のお勉強も\nだいぶ進んできたね～\n補習卒業も近いかな？\n少し寂しいけど…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 101802, 688, 102, "テストがんばったね～\nご褒美に先生が\n特別な授業\nしてあげるね？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 101802, 689, 1, "朝の特別授業\nしてあげましょうか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 101802, 690, 2, "午後の授業って\n眠いでしょう？\n気持ちは分かるけど\nがんばってね♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 101802, 691, 3, "明日の予習はやった？\n先生も手伝うから\n寝る前にやりましょ♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101802, 692, 1, "もしかして…\n少し露出多いかしら？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101802, 693, 2, "私の膝枕と、どっちが\nフカフカかしら？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101802, 694, 3, "可愛いわね～\n教室に置いたら\n生徒が喜ぶかしら？　", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101802, 695, 4, "は～落ち着くなぁ～\n教師には\nこういうゆとりも\n必要よね♪　", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101802, 696, 5, "まだ寒いわぁ\n誰か隣に\n来てくれたら…　", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101802, 697, 6, "運動部の顧問も\nできるかしら？　", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101802, 698, 7, "あん！\nお胸にこぼしちゃった", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 101802, 699, 8, "あぁーん♪\nこういう物語みたいな\n恋愛あこがれる～　", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102001, 701, 1, "おにいちゃんは、\nにんじん食べられる？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102001, 702, 2, "えへへ、\nお絵かきしよ～♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102001, 703, 3, "あのね、ミミと\nあそんでほしいな～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102001, 704, 4, "さっきね、きれいな\nお花見つけたよ。\nおにいちゃんにも\n見せてあげたいな～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102001, 705, 5, "うさぎさん、\nぴょんぴょん\nぴょーん♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102001, 706, 101, "おにいちゃんの絵、\nかいてあげるね♪", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102001, 707, 102, "おっきくなったら\nおにいちゃんの\nお嫁さんになるんだ♪", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102001, 708, 1, "ふわぁ！\nおにいちゃんの手、\nおっきいね～", 1);
