INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102001, 710, 3, "ねえねえ\nおにいちゃん、\n一緒にあそぼっ♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102001, 711, 4, "おにいちゃん、\n遊んでくれるの？\n　わぁい♪", 1);
