INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 102002, 741, 3, "眠くなっちゃった～\nおにいちゃん！\n今日は一緒に寝よ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102002, 742, 1, "ミミも\nうさぎさんみたいに\nかわいくなりたいな", 1);
