INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102002, 749, 8, "ミミね！\nこのお話だーい好き！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102101, 751, 1, "はぅぅ…\n部屋のどこにいたら\nいいんだろう…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102101, 752, 2, "お外より\nお部屋の中の方が\n落ち着くな…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102101, 753, 3, "クッキー焼いたら\nみんな食べてくれる\nかなぁ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102101, 754, 4, "あ、あめんぼあかいな\nあいうえお！", 1);
