INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102101, 757, 102, "れ、恋愛劇…\nお、お兄ちゃんと\n練習…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102101, 758, 1, "こ、この本、とっても\nおもしろいんですよ♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102101, 759, 2, "い、一緒に遊んで\nくれるんですか？\nや、やったぁ～♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102101, 760, 3, "ランドソルには\n慣れましたか？\nわ、私はまだ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102101, 761, 4, "お、お兄ちゃん、\nお、お話の練習に\n付き合って欲しいです", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102101, 762, 101, "リボンがかわいい？\nほ、ほぇぇぇ～～\nは、恥ずかしいですぅ", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102101, 763, 102, "お兄ちゃん…♪\nえへへ、呼んでみた\nだけです…♪", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 102101, 764, 1, "今日は一日、\n恥ずかしがらずに\n過ごせるかなあ…？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 102101, 765, 2, "お昼ご飯、どうぞ♪\nわ、私、お料理、\nうまくなったかな？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 102101, 766, 3, "おにいちゃんが\n帰ってくるまで、\nがんばって\n起きてました", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102101, 767, 1, "可愛い女の子に変身！\n出来ますように…♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102101, 768, 2, "ふかふかで\nあったかくて…\nお兄ちゃんみたい♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102101, 769, 3, "この子を相手に、\n演技の練習～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102101, 770, 4, "リボンや服に\n染み込ませておこう。\nいつでもいい匂い♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102101, 771, 5, "えへへ。\nぽっかぽかです…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102101, 772, 6, "はぁはぁ…\nふひぃ…\nはうぅぅぅ～～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102101, 773, 7, "もぐもぐ…えへへ、\n美味しいものを\n食べてると幸せです", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102101, 774, 8, "戯曲を読んで\n自分が演じるところを\n想像するの…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102102, 776, 1, "かわいいものを\nこうして並べて…\nはぁ…落ちつくぅ♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102102, 777, 2, "ふぁ～、この部屋は\n時間がゆったりと\n流れてるみたい", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102102, 778, 3, "この台本、感動…\n涙が止まらないよぉ\nいつか演じてみたいな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102102, 779, 4, "お芝居には\n人間観察が大事…\nじーーーーーー…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102102, 780, 5, "あえいうえおあお\nかけきくけ、かっ…\nむ、難しいですぅぅ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102102, 781, 101, "お、お腹が空いた時は\n言ってくださいね\nが、頑張って\n作ります！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102102, 782, 102, "れ、恋愛劇…\nお、お兄ちゃんと\n練習…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102102, 783, 1, "こ、この本、とっても\nおもしろいんですよ♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102102, 784, 2, "お兄ちゃんと\nいっぱい話せた日は、\n嬉しくなっちゃいます", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102102, 785, 3, "何か私にできる事\n…そうだ！\nお掃除しますね！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102102, 786, 4, "私、ちょっとずつ、\n自分に自信が\nついてきたかもです…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102102, 787, 101, "リボンがかわいい？\nほ、ほぇぇぇ～～\nは、恥ずかしいですぅ", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102102, 788, 102, "お兄ちゃん…♪\nえへへ、呼んでみた\nだけです…♪", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 102102, 789, 1, "おはようございます♪\n声出しして、お芝居の\n練習しなくちゃ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 102102, 790, 2, "お茶にしますか？\nクッキー焼いたので、\nよかったら…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 102102, 791, 3, "寝る前に\n台本を読むと、\n覚えやすいんです", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102102, 792, 1, "可愛い女の子に変身！\n出来ますように…♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102102, 793, 2, "はぅ…\nフッカフカァ…\n癒されちゃいます…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102102, 794, 3, "この子を相手に\n演技の練習～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102102, 795, 4, "リボンや服に\n染み込ませておこう\nいつでもいい匂い♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102102, 796, 5, "えへへ\nぽっかぽかです…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102102, 797, 6, "え、演劇には\nた、体力も重要\nだから～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102102, 798, 7, "残さず\n食べますね…！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102102, 799, 8, "戯曲を読んで\n自分が演じるところを\n想像するの…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102201, 801, 1, "ねえ、人見知りを\n治すための練習に\n付き合ってくれない？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102201, 802, 2, "アカリみたいに\nかわいくなるには、\nどうすればいいのかな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102201, 803, 3, "レアカードをゲット！\nねえねえ、\nすごいでしょ！？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102201, 804, 4, "ア、アイツと同じ\n部屋にいるのよね…\nって、だから何よ！？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102201, 805, 5, "楽しいゲームって\nやめどきが\n見つからないわ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102201, 806, 101, "もっと女の子らしく\nなったらアイツも\n嬉しいかな…って、\n何考えてるの！？", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102201, 807, 102, "うぅ…最近、\nアイツを見るとなんか\nドキドキするのよね", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102201, 808, 1, "ゲームに負けた罰\nだからって、\nくすぐるのは…\nあはは…ダメだって！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102201, 809, 2, "アンタと話すのは割と\n緊張しないのよね\n…なんでかな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102201, 810, 3, "待ちきれない…\n新作ゲームの発売日が\n待ちきれない…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102201, 811, 4, "アンタは人見知り\nしないタチよね？\nいいなあ～…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102201, 812, 101, "ア、アンタってさ\n好きな人とかい…\nなな、何でもない！", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102201, 813, 102, "アンタと…そ、その\nこうして話してるのも\nわわ、悪くないわね！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 102201, 814, 1, "おおおおはよう！\n…よし！　ちゃんと\nあいさつできたわ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 102201, 815, 2, "一緒にごはんとか…\nううん、やっぱいい！\nなんでもないからっ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 102201, 816, 3, "夜はこれからよ！\n朝まで\nゲームするからね！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102201, 817, 1, "アカリみたいに\n可愛くなるのは\n難しいかな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102201, 818, 2, "寝っ転がりながら\nゲームができれば\n気分が良さそう", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102201, 819, 3, "可愛い…けど、\n私には似合わないかな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102201, 820, 4, "はあ、リラックスして\nゲームができるわ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102201, 821, 5, "ん…暖かくて、\n寝落ちしちゃいそう", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102201, 822, 6, "ゲーム感覚でやると、\n体動かすのも\n楽しいわね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102201, 823, 7, "ゲームは頭使うから\nそのぶん\n栄養がいるのよ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102201, 824, 8, "ふむふむ、なるほど\n友だちを作るには\n笑顔が大事っと…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102202, 826, 1, "さあ、今日は\n何のゲームで\n遊ぼうかな？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102202, 827, 2, "一緒にゲームができる\n人がいるっていうのも\n新鮮だな…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102202, 828, 3, "レアカードをゲット！\nすごいでしょ！？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102202, 829, 4, "アカリってどうやって\n友達作ってるんだろ？\nコツがあるのかな…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102202, 830, 5, "楽しいゲームって\nやめどきが\n見つからないわ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102202, 831, 101, "うぅ…最近\nアイツを見るとなんか\nドキドキするのよね", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102202, 832, 102, "ね、ねえ\nもう少しその…\n一緒にゲームしない？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102202, 833, 1, "ねえ、人見知りを\n治すための練習に\n付き合ってくれない？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102202, 834, 2, "欲しいゲームが\n見つからなくて…\n探すの手伝って！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102202, 835, 3, "ねえ、見て！\n新しいゲームを\n買って来たの！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102202, 836, 4, "ゲームに負けた罰\nだからって、くすぐる\nのは…あ、あはは！\nだ、ダメだって！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102202, 837, 101, "ア、アンタってさ\n好きな人とかい…\nなな、何でもない！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102202, 838, 102, "あ、あのさ…\nもう少し、そこに\nいてくれてもいいわよ", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 102202, 839, 1, "おおおおはよう！\n…よし！　ちゃんと\nあいさつできたわ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 102202, 840, 2, "一緒にごはんとか…\nううん、やっぱいい！\nなんでもないからっ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 102202, 841, 3, "夜はこれからよ！\n朝まで\nゲームするからね！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102202, 842, 1, "もっと女の子らしく\nなったらアイツも\n嬉しいかな…って、\n何考えてるの！？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102202, 843, 2, "ふああ…\n徹夜明けには\n辛い誘惑だな…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102202, 844, 3, "可愛い…けど、\n私には似合わないかな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102202, 845, 4, "こういうのに詳しいと\n女の子っぽく\n見えたりするのかな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102202, 846, 5, "寒い日は\nここでゲームするのが\n最高のぜいたくよね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102202, 847, 6, "最近ゲームばかりだし\nたまにはいいかな？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102202, 848, 7, "ゲームは頭使うから\nそのぶん\n栄養がいるのよ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102202, 849, 8, "ふむふむ、なるほど\n友だちを作るには\n笑顔が大事っと…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102301, 851, 1, "じゃんけんぽん！\nあっち向いてほい！\nあ～ん、負けたぁ\n　『勝ったぜ！』", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102301, 852, 2, "ぷうきちがいれば、\nなんでも出来ちゃうよ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102301, 853, 3, "発声練習しよっと\nぷうきち\nフルスイ～ング！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102301, 854, 4, "ここで、ぷうきち\nフルスイングは、\nまずいかな～？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102301, 855, 5, "この部屋、ぷうきちを\n置く場所はないのかな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102301, 856, 101, "お兄ちゃんって…\nちょっとぷうきちに\n似てるかも♪", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102301, 857, 102, "お兄ちゃんにも、\nぷうきちのこと\n好きになって\nもらいたいな～", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102301, 858, 1, "おやつは、\n私とぷうきちの\n二人分用意してね♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102301, 859, 2, "ぷうきちが、お腹\nペコペコだって～\n何かちょうだい！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102301, 860, 3, "『アヤネに手出したら\n…坊ちゃんでも、\n分かってんな？』", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102301, 861, 4, "ぷうきちとの\n連携を磨いてるの！\nもっと仲良くなるよ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102301, 862, 101, "特別だからね？\nもっと触っていいよ\n…ぷうきちのこと", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102301, 863, 102, "お兄ちゃんのこと、\n「ぷう兄」って\n呼ぼうかな？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 102301, 864, 1, "お兄ちゃんって\n朝早いんだね～\n私はまだ眠いよ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 102301, 865, 2, "ふぁ～…ぷうきちと\nお昼寝してくるね…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 102301, 866, 3, "ぷうきちと\nおしゃべりしてたら\nもうこんな時間…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102301, 868, 2, "『座り心地がいいな』\nぷうきちは座れない\nでしょ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102301, 869, 3, "かわいい～！\nぷうきちのお友達に\nしちゃおうかな？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102301, 870, 4, "いいニオイ～♪\nぷうきちも\n気に入ったみたい！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102301, 871, 5, "ぽわぽわする～\nぷうきちも\n気持ちいい？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102301, 873, 7, "おいしい～\nぷうきちも\n食べてみる？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102301, 874, 8, "ぷうきち！\nこの本、読んで～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102501, 901, 1, "どうして失敗ばっかり\nこうなったら\n腹を切るしか～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102501, 902, 2, "あれ？　あれ？\nお部屋の中で迷子に\nなっちゃいました～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102501, 903, 3, "どうしたら転ばなく\nなるんでしょうか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102501, 904, 4, "わわわわ～～っ\nふう…\nきゃ、きゃあっ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102501, 905, 5, "私のドジで、\nこのお部屋を\n壊しちゃったら\nどうしましょう～～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102501, 906, 101, "おいしい料理で\nお出迎えしなくちゃ！", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102501, 907, 102, "一生懸命\nご奉仕しますよ～♪", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102501, 908, 1, "耳かきしましょうか？\nえ？　こわい？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102501, 909, 2, "お疲れでしたら、\nお昼寝しませんか？\n膝枕もしますよ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102501, 910, 3, "おかえりなさいませ\nご主人さま♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102501, 911, 4, "すみません\nすみません\nすみません～～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102501, 912, 101, "メイドの私が、\nこんな気持ちを持って\nいいんでしょうか…", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102501, 913, 102, "私のこと、\n専属メイドと思って\n頼ってくださいね", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 102501, 914, 1, "おはようございます♪\n今日も一日がんば…\nきゃ、きゃあ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 102501, 915, 2, "お昼ごはん…\n失敗しちゃいましたぁ\nお、おやつでリベンジします！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 102501, 916, 3, "明日の目標は\nドジをしないです！\nき、昨日の目標も\nドジをしないでした", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102501, 917, 1, "あ、メイド服が\nほつれてる\n後でお裁縫しなくちゃ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102501, 918, 2, "休憩が終わったら\nお洗濯にお料理に\nお掃除もしないと！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102501, 919, 3, "かわいい♪\nあとでお洗濯\nしてあげますね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102501, 920, 4, "いい香り…\nお嬢様のお部屋にも\n置いてあげたいです", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102501, 921, 5, "ここでお洗濯ものを\n乾かしましょうか", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102501, 922, 6, "あわわわっ…\nこ、転びそうです～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102501, 923, 7, "これくらい\nおいしいものを\n作ってみたいです～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102501, 924, 8, "物語のメイドさんって\n御主人さまを好きに\nなるんですよね…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102502, 926, 1, "失敗したら、この\nお部屋追い出され\nちゃうかも～？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102502, 927, 2, "あれ？　あれ？\nお部屋の中で迷子に\nなっちゃいました～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102502, 928, 3, "どうやったら、立派な\nメイドになれるのかな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102502, 929, 4, "塩にはＳマーク\n砂糖にはＳマーク\n…あ、あれ！？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102502, 930, 5, "ご用があれば\nなんでも言って\nくださいね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102502, 931, 101, "迷惑をかけすぎて…\n嫌われちゃったら\nどうしましょう", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102502, 932, 102, "メイドの私が\nこんな気持ちを持って\nいいんでしょうか…　", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102502, 933, 1, "おでかけですか？\nいってらっしゃいませ\nご主人さま♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102502, 934, 2, "どうして失敗ばっかり\nこうなったら\n腹を切るしか～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102502, 935, 3, "私、またなにか\nやっちゃいましたか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102502, 936, 4, "おいしいお茶っ葉が\n手に入りました～♪\n一緒に飲みませんか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102502, 937, 101, "転んだふりであの人に\n…って！\nなんでもないですよ！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102502, 938, 102, "私、できることなら\nなんでもやりますよ\nあなたのためですから", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 102502, 939, 1, "おはようございます♪\n今日も一日がんば…\nう、うわあ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 102502, 940, 2, "お昼ごはん…\n失敗しちゃいましたぁ\nお、おやつでリベンジします！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 102502, 941, 3, "明日の目標は\nドジをしないです！\nき、昨日の目標も\nドジをしないでした", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102502, 942, 1, "あ、メイド服が\nほつれてる\n後でお裁縫しなくちゃ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102502, 943, 2, "いい座り心地です～\nこれならお嬢さまも\nゆったりできますね♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102502, 944, 3, "かわいい♪\nあとでお洗濯\nしてあげますね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102502, 945, 4, "いい香り…\nお嬢様のお部屋にも\n置いてあげたいです", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102502, 946, 5, "暖かいですけど\n…私が火に近づいて\n大丈夫でしょうか！？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102502, 947, 6, "運動しようとすると\nいつも怪我するん\nですよね…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102502, 948, 7, "こんなに美味しいもの\nメイドの私には\nもったいないです～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102502, 949, 8, "物語のメイドさんって\n御主人さまを好きに\nなるんですよね…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102701, 951, 1, "あの方と私だけの\n部屋にしたいですわ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102701, 952, 2, "あの方は私のもの…\n眼も耳も鼻も口も髪も\n首も胸も腰も手も脚も\nぬくもりも心も…！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102701, 953, 3, "運命とは決して\n抗えないもの…\nクスクス…クスクス", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102701, 954, 4, "部屋からあの方の\n香りが…\nああ、至福ですわ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102701, 955, 5, "毒にも薬にもならない\n存在なんて嫌ですわ\nどうせならとびきりの\n毒でありたい…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102701, 956, 101, "クスクス…\nあの方とデートする\nイメトレ中ですわ\nクスクスクスクス…", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102701, 957, 102, "記憶を戻す研究より\n記憶をねつ造する研究\nのほうが良いかしら？\n伴侶という設定で…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102701, 958, 1, "運命を信じますか？\nもちろん絶対当然\n信じますわよね？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102701, 959, 2, "この薬は起床時就寝前\n食前食後食間に、毎日\n服用してください。\n惚れ薬ですわ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102701, 960, 3, "お願いがあるのです。\n新しい研究の実験台に\n…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102701, 961, 4, "こっそり栽培している\n毒きのこが毒々しく\n育ちましたわ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102701, 962, 101, "あなた様の前では\n普通の女の子…\n少し毒薬づくりが\n得意なだけの…", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102701, 963, 102, "私の身も心も、全てが\nあなた様のもの。\nあなた様の全ても…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 102701, 964, 1, "おはようございます\n一晩中、あなた様の\n寝顔を見ていましたわ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 102701, 965, 2, "お昼を用意しましたの\n何も入れていませんわ\nクスクス…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 102701, 966, 3, "あなた様が眠るまで\nお傍で見守りますわ。\n…あの、どうして\n眠らないのですか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102701, 967, 1, "いっそ鏡の中に\n閉じ込めてしまえたら\n私だけのものに…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102701, 968, 2, "はっ！\nリラックスしたら\n閃きましたわ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102701, 969, 3, "あら、キメラの素体に\nぴったりですわ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102701, 970, 4, "このお部屋は\n良い香りがしますわ。\nはっ、あなた様の匂い\nなのでは…！？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102701, 971, 5, "あたたかい…\n加熱調合にも\n使えそうですわね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102701, 972, 6, "この運動エネルギー\n何かにうまく\n利用できないかしら？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102701, 973, 7, "美味しい。あの方にも\n差し上げましょう…\n薬を入れて…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102701, 974, 8, "あの方を虜にする\n方法がどこかに\n載ってるはずですわ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102702, 976, 1, "あの方と私だけの\n部屋にしたいですわ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102702, 977, 2, "こっそり栽培している\n毒きのこが毒々しく\n育ちましたわ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102702, 978, 3, "新しい薬\nどうやってあの方に\n飲ませようかしら", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102702, 979, 4, "部屋からあの方の\n香りが…\nああ、至福ですわ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102702, 980, 5, "記憶を戻す研究より\n記憶をねつ造する研究\nのほうが良いかしら？\n伴侶という設定で…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102702, 981, 101, "クスクス…\nあの方とデートする\nイメトレ中ですわ\nクスクスクスクス…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102702, 982, 102, "魔法も科学も錬金術も\n全て駆使して\nあの方のために…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102702, 983, 1, "この部屋には雌犬…\n失礼、女の方がとても\n沢山いますのね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102702, 984, 2, "あなた様には私の伴侶\nとして高い教養を…\nあ、逃げられてしまい\nましたわ…！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102702, 985, 3, "お願いがあるのです\n新しい研究の\n実験台に…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102702, 986, 4, "あなた様が寝ている時\n私は…クスクス\nこれ以上は言えません", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102702, 987, 101, "想像の中のあなた様は\nすっかり私の虜なのに\n現実は…\nもどかしいですわね", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102702, 988, 102, "あなた様の前では\n普通の女の子…\n少し毒薬づくりが\n得意なだけの…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 102702, 989, 1, "おはようございます\n一晩中、あなた様の\n寝顔を見ていましたわ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 102702, 990, 2, "さあ、お食事ですよ\n味は保証しますわ\n特製ソースで少しだけ\n体が痺れますけど…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 102702, 991, 3, "あなた様が眠るまで\nお傍で見守りますわ\n…あの、どうして\n眠らないのですか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102702, 992, 1, "私ももう少し\n外見に気を配る\nべきでしょうか…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102702, 993, 2, "はっ！\nリラックスしたら\n閃きましたわ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102702, 994, 3, "この私を差し置いて\nあなた様に媚びるなど\n言語道断…っ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102702, 995, 4, "このお部屋は\n良い香りがしますわ\nはっ、あなた様の匂い\nなのでは…！？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102702, 996, 5, "素敵なぬくもり…\nまるであの方に\n抱きしめられたような", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102702, 997, 6, "この運動エネルギー\n何かにうまく\n利用できないかしら？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102702, 998, 7, "美味しい。あの方にも\n差し上げましょう…\n薬を入れて…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102702, 999, 8, "あの方を虜にする\n方法がどこかに\n載ってるはずですわ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102801, 1001, 1, "子供たちの遊びって\nあたしが子供の頃と\nあまり変わらないのね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102801, 1002, 2, "使えるものは\n再利用しないと\n…あ、これとか\nまだ使えるわね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102801, 1003, 3, "贅沢は敵！　とはいえ\n気持ちに余裕のない\n暮らしはダメよね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102801, 1004, 4, "お腹空いたわね、\n残り物で\n何か作ろうかしら", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102801, 1005, 5, "商売はノンゼロサムが\n理想だなぁ。誰も損を\nしないってことだもの", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102801, 1006, 101, "あんたが手伝って\nくれるから、仕事も\n前より楽しいのよね♪", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102801, 1007, 102, "焼きそばパンが\n食べたいな～\nあいつと…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102801, 1008, 1, "ねぇあんた、どこか\n安いお店知らない？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102801, 1009, 2, "あたし、エレガントに\n振る舞えてる？\n…そう？　嬉しい♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102801, 1010, 3, "いっぱい働いて遊んで\nよく休んでまた働く。\nそれが健全な生活よね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102801, 1011, 4, "一緒に部屋の\n整頓でもする？\nハマると楽しいわよ♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102801, 1012, 101, "あんたがいると\n子供たちも喜ぶわ♪\nもちろんあたしもね！", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102801, 1013, 102, "ね、あんた今、幸せ？\n何びっくりしてるのよ\n大事なことじゃないの", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 102801, 1014, 1, "面倒な用事は午前中に\n片づけてしまうのが、\n時間の使い方のコツよ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 102801, 1015, 2, "午後のティータイム\nとかどう？\n良いカフェがあるの♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 102801, 1016, 3, "さ、エレガントな夜を\n楽しみましょ。\nモダンな音楽でも\nかけましょうか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102801, 1017, 1, "レディたるもの\n身嗜みはしっかりとね\n見本にならないと♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102801, 1018, 2, "これで仕事は一段落ね\nちょっと休憩…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102801, 1019, 3, "うふふ、\nかわいいものを\n見るのは幸せね～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102801, 1020, 4, "部屋中がいい香り…\nなんだかすごい贅沢\nしてる気分♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102801, 1021, 5, "風邪を引かないように\n身体を温めなくちゃ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102801, 1022, 6, "さっ！　家の中でも\n効率的に\nトレーニングよ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102801, 1023, 7, "もぐもぐ…はっ、\n口の周り、\n汚れてないわよね？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102801, 1024, 8, "知識から過去を学んで\n未来に活かすわよ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102802, 1026, 1, "安売りのお店の情報\n整理しないと…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102802, 1027, 2, "どんなに苦労してても\nそう見せないのが真の\nエレガントなレディよ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102802, 1028, 3, "安く済んであいつが\n喜ぶ料理とか…\nないかしら", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102802, 1029, 4, "子供たちの遊びって\nあたしが子供の頃と\nあまり変わらないのね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102802, 1030, 5, "商売はノンゼロサムが\n理想だなぁ。誰も損を\nしないってことだもの", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102802, 1031, 101, "焼きそばパンが\n食べたいな～\nあいつと…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102802, 1032, 102, "あいつと一緒に…\n色々なところに\nいきたいな", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102802, 1033, 1, "今度買い物に\n付き合いなさい\nセールがあるのよ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102802, 1034, 2, "あんたがいると子供\nたちも喜ぶわ♪\nもちろんあたしもね♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102802, 1035, 3, "いっぱい働いて遊んで\nよく休んでまた働く\nそれが健全な生活よね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102802, 1036, 4, "あんたとこうして\nのんびりするのも\nいいものね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102802, 1037, 101, "ねえ、今度遊びに\n行きたいな\nもちろん一緒に、よ", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102802, 1038, 102, "あんたが手伝って\nくれるから、仕事も\n前より楽しいのよね♪", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 102802, 1039, 1, "面倒な用事は午前中に\n片づけてしまうのが\n時間の使い方のコツよ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 102802, 1040, 2, "ランチにして午後の\n仕事に備えましょ！\nやることは一杯よ♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 102802, 1041, 3, "ふわあ～\nもうこんな時間\n子供たちは\nもう寝たかしら", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102802, 1042, 1, "忙しい時こそ\n身だしなみは隙なく\nぴしっとね！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102802, 1043, 2, "これで仕事は一段落ね\nちょっと休憩…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102802, 1044, 3, "ふふふ\nずっと眺めてたく\nなっちゃうわね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102802, 1045, 4, "部屋中がいい香り…\nなんだかすごい贅沢\nしてる気分♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102802, 1046, 5, "風邪を引かないように\n身体を温めなくちゃ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102802, 1047, 6, "さっ！　家の中でも\n効率的に\nトレーニングよ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102802, 1048, 7, "しっかり食べて\n栄養補給、栄養補給！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102802, 1049, 8, "知識から過去を学んで\n未来に活かすわよ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102901, 1051, 1, "可愛い子が\nいっぱいいるなぁ…\n誰か私とユニット\n組んでくれないかな？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102901, 1052, 2, "今度のライブ会場、\nいつもより大きいから\n楽しみなんだ～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102901, 1053, 3, "新曲の衣装、もうすぐ\n出来あがるんだって！\n楽しみだな～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102901, 1054, 4, "彼とデュエット\nしてみたいな～♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102901, 1055, 5, "キラキラ無病息災、\nドキドキ一日一善…\n作詞って難しい～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102901, 1056, 101, "ファンはもちろん\n大事だけど…\n彼のことは、もっと\n大切にしたいな…", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102901, 1057, 102, "写真集見なくても、\n本物がここに\nいるのにな～", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102901, 1058, 1, "握手会の練習、\n付き合ってくれない？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102901, 1059, 2, "写真集のポーズ\n練習中～！\nど、どうかな？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102901, 1060, 3, "何て書いてあるか\n読めないって？\nもー！\nこれは私のサイン！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102901, 1061, 4, "ね、次のライブ\n観に来てくれる？\nいい席とっとくから！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102901, 1062, 101, "ねぇ、台本読むの\nつきあってくれる？\n恋人役に\nなってほしいんだ", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102901, 1063, 102, "新曲、聞いてくれた？\nキミとのことを\nテーマにしたんだよ。\nどこかは秘密だけど♪", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 102901, 1064, 1, "朝の発声練習に\n行くけど、キミも\n一緒に来ない？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 102901, 1065, 2, "この時間は\nお腹すくけど…\n水着撮影があるから\nお昼抜いてるんだ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 102901, 1066, 3, "夜の帳が二人を包み\n…こういう方向性の\n歌詞も悪くないなぁ。", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102901, 1067, 1, "身だしなみオッケー！\nアイドルはいつでも\n完璧でいなくちゃ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102901, 1068, 2, "ふぅ…\nこんな姿、ファンには\n見せられないな～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102901, 1069, 3, "かわいい～♪\nこれは強力な\nライバル登場かな！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102901, 1070, 4, "ステキな香り～♪\n歌詞のイメージが\n浮かんできそう！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102901, 1071, 5, "体も暖まったし！\nダンスレッスンに\n行こうかな♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102901, 1072, 6, "ベストタイム更新！\nライブに向けて\n体力つけないと…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102901, 1073, 7, "太っちゃったら\nどうしよう…？\nでも手が止まらない～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102901, 1074, 8, "ステキなお話…\n新曲の作詞の\n参考になりそう♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102902, 1076, 1, "このお部屋すてき！\nファンに追われた時の\n隠れ家にピッタリね！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102902, 1077, 2, "そろそろイメチェン\nしてみようかな…\nそれともこの路線で\nもう少し…？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102902, 1078, 3, "みんながくれた\nファンレター…\n私の大事な宝物…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102902, 1079, 4, "彼とデュエット\nしてみたいな～♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102902, 1080, 5, "疾風怒濤、威風堂々\n獅子奮迅、唯我独尊…\nラブソングの作詞って\n難しいな～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102902, 1081, 101, "ファンはもちろん\n大事だけど…\n彼のことは、もっと\n大切にしたいな…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 102902, 1082, 102, "トップアイドルの\nさらに先…\n彼とならその景色も\n見られるかな", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102902, 1083, 1, "新曲の衣装、もうすぐ\n出来あがるんだって！\n楽しみだな～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102902, 1084, 2, "アイドルノゾミだけ\nじゃなくて、私の事も\nちゃんと見てね？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102902, 1085, 3, "キミに響かないなら\nファンにも響くわけ\nないよ！　練習練習！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102902, 1086, 4, "衣装のスカートは\n鉄壁なんだよ！\n残念でした～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102902, 1087, 101, "新曲、聞いてくれた？\nキミとのことを\nテーマにしたんだよ\nどこかは秘密だけど♪", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 102902, 1088, 102, "ねぇ、私がトップ\nアイドルになっても\nちゃんと隣にいてね\n遠くに行かないでね？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 102902, 1089, 1, "朝の発声練習に\n行くけど、キミも\n一緒に来ない？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 102902, 1090, 2, "お昼ごはん行かない？\n誰にも知られてない\nお店があるんだけど！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 102902, 1091, 3, "夜の帳が二人を包み\n…こういう方向性の\n歌詞も悪くないなぁ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102902, 1092, 1, "身だしなみオッケー！\nアイドルはいつでも\n完璧でいなくちゃ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102902, 1093, 2, "ふぅ…\nこんな姿、ファンには\n見せられないな～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102902, 1094, 3, "かわいい～♪\nこれは強力な\nライバル登場かな！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102902, 1095, 4, "みんなのイメージする\nアイドルの香りは\nこんな感じかな～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102902, 1096, 5, "体も暖まったし！\nダンスレッスンに\n行こうかな♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102902, 1097, 6, "ベストタイム更新！\nライブに向けて\n体力つけないと…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102902, 1098, 7, "太っちゃったら\nどうしよう…？\nでも手が止まらない～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 102902, 1099, 8, "この恋愛小説ステキ！\n私もアイドルじゃ\nなかったら…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103001, 1101, 1, "手裏剣の数が\n合わないデス！\nどこかに落とした\nデスか…？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103001, 1102, 2, "クセモノ、隠れても\nむだデス！\n…気のせいデシタ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103001, 1103, 3, "金は天下の\nマワリモノ！\nところで、\nどういう意味デス？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103001, 1104, 4, "むむ、アクダイカンの\n気配がするデース", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103001, 1105, 5, "クニトリ合戦、\n楽しみデース！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103001, 1106, 101, "ショーグンと\n出会えて、\nワタシは果報者デス！", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103001, 1107, 102, "最近、ショーグンの\nそばにいると\nドキドキするデス…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103001, 1108, 1, "なんでも\n命令するデス！\nショーグンの命は\n絶対デス！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103001, 1109, 2, "あっ、ショーグン、\n出陣はいつで\nゴザルデス！？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103001, 1110, 3, "さ、さすが\nショーグンデス…\nいつの間に背後を！？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103001, 1111, 4, "出陣の合図に\n備えるデス！\nほら貝は\nどこデスか！？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103001, 1112, 101, "見つめられると\nドキドキするデス…\n新しい忍法デスか？", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103001, 1113, 102, "ショーグン！\nえへへ…これからも\nおそばに置いて\nクダサイね？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 103001, 1114, 1, "おはようデス！\n今日も一日\n忍法日和デス！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 103001, 1115, 2, "そろそろお腹\n空いてきたデス。\n昼ごはんにするデス！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 103001, 1116, 3, "明日もきっと\nいい日デスよ、\nショーグン！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103001, 1117, 1, "ちょんまげに\nしてみるのも\n面白いかもデス！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103001, 1118, 2, "心地よくて\n眠くなってきマス…\nもしやテキコクの\n罠デスか！？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103001, 1119, 3, "これを変わり身の\n術に…かわいそう\nだから止めるデス", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103001, 1120, 4, "ワビサビというもの\nデスね！\n素晴らしいデス！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103001, 1121, 5, "身体を暖めて\nイクサに向かうデス！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103001, 1122, 6, "アクロバットな忍法を\n使うには、体を\n鍛えないと危険デス！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103001, 1123, 7, "うーん、\n美味しいデス…\n幸せデス～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103001, 1124, 8, "これは…\nＢＵＳＨＩＤＯ…\nデスか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103002, 1126, 1, "ふんふんふ～ん\n武器の手入れは\n念入りにしマスよ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103002, 1127, 2, "クセモノ、隠れても\nむだデス！\n…気のせいデシタ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103002, 1128, 3, "金は天下の\nマワリモノ！\nところで\nどういう意味デス？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103002, 1129, 4, "むむ、アクダイカンの\n気配がするデース", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103002, 1130, 5, "クニトリ合戦\n楽しみデース！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103002, 1131, 101, "最近、ショーグンの\nそばにいると\nドキドキするデス…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103002, 1132, 102, "ショーグンの身は\n何があってもワタシが\n守るデス！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103002, 1133, 1, "あっ、ショーグン\n出陣はいつで\nゴザルデス！？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103002, 1134, 2, "イクサの前に\nホネ休めも大事デスよ\nゆっくりするデース！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103002, 1135, 3, "さ、さすがショーグン\nデス…いつの間に\n背後を！？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103002, 1136, 4, "一緒に忍法考える\nデス！\nショーグン用の\n忍法も必要デスね！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103002, 1137, 101, "見つめられると\nドキドキするデス…\n新しい忍法デスか？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103002, 1138, 102, "ショーグン！\nえへへ…これからも\nおそばに置いて\nクダサイね？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 103002, 1139, 1, "いい朝デス！\nトーゴク風の朝ゴハン\n作るデス！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 103002, 1140, 2, "もうお昼デス\nお昼寝するデスか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 103002, 1141, 3, "そろそろおネム\nデース…\n一緒に寝るデス？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103002, 1142, 1, "服の乱れは心の乱れ\nデス！　きっちり\nしないといけないデス", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103002, 1143, 2, "心地よくて眠く\nなってきマス…\nもしやテキコクの\n罠デスか！？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103002, 1144, 3, "これを変わり身の\n術に…かわいそう\nだから止めるデス", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103002, 1145, 4, "ワビサビというもの\nデスね！\n素晴らしいデス！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103002, 1146, 5, "身体を暖めてイクサに\n向かうデス！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103002, 1147, 6, "ショーグンのお役に\n立つため、修行\nあるのみデス！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103002, 1148, 7, "美味しいデス…\n酢昆布を和えて\nみたいデス", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103002, 1149, 8, "物事を知って\n来たるべきイクサに\n活かすデス", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103101, 1151, 1, "お父さん、そろそろ\n子離れを…しない？\nそうですか…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103101, 1152, 2, "父は、いつも男性に\nきびしいですね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103101, 1153, 3, "占ってほしい人は、\nいつでも言って\nください", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103101, 1154, 4, "あなたの手相は…\nて、手を握るのって\n緊張しますね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103101, 1155, 5, "この部屋、風水的にも\n運気が上がりそうです", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103101, 1156, 101, "あの人とのこと占って\nみようかな…\n好き…嫌い…\n好き♪…き、嫌い", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103101, 1157, 102, "私との相性ですか？\nそれなら占う必要は\nありませんよ…\nふふっ♪", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103101, 1158, 1, "女難の相が\n出ていますね…\n気をつけてください", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103101, 1159, 2, "今日のあなたの運勢は\n大きょ…\n大吉です", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103101, 1160, 3, "父と散歩中です。\n毎日決まったコースを\n散歩させないと、\nストレスが溜まるので", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103101, 1161, 4, "小僧！\nシノブに触るとは\nいい度胸じゃねぇか！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103101, 1162, 101, "あなたに触られると、\n動悸が早くなります\nもしかして心霊現象？", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103101, 1163, 102, "今日もたくさんの幽霊\nに慕われていますね。\n素敵です", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 103101, 1164, 1, "おはようございます\n今日の運勢を\n占いましょうか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 103101, 1165, 2, "今日のラッキー\nアイテムはドクロです\n良ければ父を\nお貸ししましょうか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 103101, 1166, 3, "今日のあなたの運気は\n最高潮でした。\nもうすぐ今日は\n終わりますが", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103101, 1167, 1, "お父さん。\nいつも、身だしなみに\n気を使ってるけど、\nあまり変わってないよ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103101, 1168, 2, "一休みしましょう。\n憑かれて疲れました", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103101, 1169, 3, "かわいい…\n付喪神が宿らないかな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103101, 1170, 4, "お父さん、\nリラックスし過ぎると\n成仏しちゃうよ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103101, 1171, 5, "気持ちいいです…\n極楽浄土みたい…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103101, 1172, 6, "はぁはぁ…\nお、お父さん、\n代わりに運動して…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103101, 1173, 7, "お父さんも\n食べたいの？\n死んでるのに？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103101, 1174, 8, "この本…\nもしかして予言書？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103102, 1176, 1, "ここにいる幽霊は\nみんな幸せそうです", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103102, 1177, 2, "お父さんが\n女の子ばかりに\n声をかけるので\n困っています", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103102, 1178, 3, "成仏はうれしいこと\nです…でも友達が\n減るのは寂しいですね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103102, 1179, 4, "幽霊に好かれる人は\n素敵な方です\nもちろん、あなたも", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103102, 1180, 5, "お父さん、そろそろ\n子離れを…しない？\nそうですか…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103102, 1181, 101, "生きている人に\n好かれるには、\nどうすればいい\nのでしょう？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103102, 1182, 102, "お父さん、どうしたら\nあの人のことを\n認めてくれますか？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103102, 1183, 1, "この部屋、風水的にも\n運気が上がりそうです", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103102, 1184, 2, "シノブには指一本\n触れさせん！\nガブッ！！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103102, 1185, 3, "あなたの手相は…\nて、手を握るのって\n緊張しますね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103102, 1186, 4, "ラップ音？\nいえ、父のいびきです", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103102, 1187, 101, "私との相性ですか？\nそれなら占う必要は\nありませんよ…\nふふっ♪", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103102, 1188, 102, "前世って信じますか？\n私とあなたは\nもしかすると…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 103102, 1189, 1, "今日のラッキー\nアイテムはドクロです\n良ければ父を\nお貸ししましょうか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 103102, 1190, 2, "明るい時間は\nあまり得意では\nないんです…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 103102, 1191, 3, "夜のお散歩に\n行きませんか？\n知り合いの幽霊に\n挨拶して回るんです", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103102, 1192, 1, "お父さん\nいつも、身だしなみに\n気を使ってるけど\nあまり変わってないよ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103102, 1193, 2, "うとうと…\nあれ…\n走馬灯が見える…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103102, 1194, 3, "かわいい…\nお父さんみたい…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103102, 1195, 4, "お父さん\nリラックスし過ぎると\n成仏しちゃうよ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103102, 1196, 5, "快適です…\n幽霊もどんどん\n集まってきますね…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103102, 1197, 6, "はぁはぁ…\nお、お父さん、\n代わりに運動して…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103102, 1198, 7, "お父さんの分も、\n私が食べるね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103102, 1199, 8, "この本の占い\n私の占いと違う…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103201, 1201, 1, "私だって、一人で\n買い物ぐらい\nできますわ…きっと", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103201, 1202, 2, "そろそろ新しい\n案件を始めないと\nいけませんわね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103201, 1203, 3, "一日も早く、\n一人前の商人に\nなりたいものです", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103201, 1204, 4, "平和を買うのには\nどれほどのお金が\n必要なのかしら？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103201, 1205, 5, "ここももう少し広いと\n落ち着くのですけど。\n改築しませんこと？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103201, 1206, 101, "あの方はお金で雇った\nわけではないのに\n私といてくださる…", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103201, 1207, 102, "たとえ私が間違っても\nきっとあの方が\n正してくれますわ…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103201, 1208, 1, "私と、庶民向けの\nお店へ一緒に\n参りませんか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103201, 1209, 2, "資産運用？\nお幾らほど\n増やしたいのです？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103201, 1210, 3, "どんぶり勘定だとよく\n言われるのですが…\n例えが小さすぎます！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103201, 1211, 4, "お金で解決するのは\n悪いことでは\nありませんわよね？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103201, 1212, 101, "その、よろしければ\n私とお散歩など\nいかがです？", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103201, 1213, 102, "もしあなたさまが\n道に迷われるなら、\n私もお供いたします！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 103201, 1214, 1, "早起きは三ルピの徳と\n申しますが…\nもっとお得ですわね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 103201, 1215, 2, "昼食は町の屋台で\n立ったまま食べて\nみたいですわ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 103201, 1216, 3, "よろしければ\nお休み前のミルクを\n御一緒にいかが？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103201, 1217, 1, "だらしない身なりでは\n取引相手に信用して\nいただけませんものね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103201, 1218, 2, "この感触と安らぎ…\n素晴らしい\n費用対効果ですわ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103201, 1219, 3, "何の見返りも求めず\nただひたすら愛でて\nいたいのです！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103201, 1220, 4, "目に見えないものに\nお金をかけるのが\n真の贅沢ですわ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103201, 1221, 5, "誰ひとり寒い思いを\nしない町にするために\n私にできる事は…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103201, 1222, 6, "健康はお金では\n買えませんが\n運動器具は別ですわ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103201, 1223, 7, "なかなか\n美味ですわ\nシェフはどちらに？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103201, 1224, 8, "経済の仕組みを\nしっかりと\n学ばなくては…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103202, 1226, 1, "そろそろ新しい\n案件を始めないと\nいけませんわね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103202, 1227, 2, "ええと、これは\nおいくらで買ったん\nでしたっけ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103202, 1228, 3, "お金を見せたら\n態度が変わる人は\n信用できませんわ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103202, 1229, 4, "地図が読めずとも\n道に迷わない方って\nいらっしゃるのですね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103202, 1230, 5, "この狭さも\n慣れれば\n快適ですわ♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103202, 1231, 101, "あの方はお金で雇った\nわけではないのに\n私といてくださる…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103202, 1232, 102, "たとえ私が間違っても\nきっとあの方が\n正してくれますわ…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103202, 1233, 1, "一人前の商人に\n相応しい居振る舞いを\nしたいものですわ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103202, 1234, 2, "幼い頃\nお店屋さんごっこを\nなさいましたか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103202, 1235, 3, "資産運用？\nお幾らほど\n増やしたいのです？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103202, 1236, 4, "今度一緒に…\nパーティにでも\n行きませんこと？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103202, 1237, 101, "その、よろしければ\n私とお散歩など\nいかがです？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103202, 1238, 102, "あなたさまの優しさは\nお金には\n代えられませんわね", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 103202, 1239, 1, "なぜだか\n眠り足りないような\n感じがしますわ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 103202, 1240, 2, "昼食は町の屋台で\n立ったまま食べて\nみたいですわ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 103202, 1241, 3, "よろしければ\nお休み前のミルクを\n御一緒にいかが？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103202, 1242, 1, "ドレスは汚れていない\nようですが…やだ\n髪がほつれてますわ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103202, 1243, 2, "こういったものに\n腰を沈めると…\nき、気が緩んで…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103202, 1244, 3, "何の見返りも求めず\nただひたすら愛でて\nいたいのです！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103202, 1245, 4, "香りは質のいいものと\nそうでないものが\nはっきり分かりますわ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103202, 1246, 5, "誰ひとり寒い思いを\nしない町にするために\n私にできる事は…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103202, 1247, 6, "目標は遠くに\n置いた方が励みに\nなりますわ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103202, 1248, 7, "なかなか\n美味ですわ\nシェフはどちらに？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103202, 1249, 8, "商人って、物語では\n悪役にされやすいの\nですね…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103301, 1251, 1, "家の中のものを使って\n物ボケ、考えるべ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103301, 1252, 2, "毎日の日課…それは\n炊事、洗濯、大喜利\nだべ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103301, 1253, 3, "うちに塀ができたら、\nへー、って言いたい！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103301, 1254, 4, "オラが作る料理は\nこの後スタッフで\n美味しくいただくべよ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103301, 1255, 5, "エリザベスも\n連れてきてぇ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103301, 1256, 101, "あんちゃんも、\nエリザベスと同じ位\nめんこいべ♪", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103301, 1257, 102, "オラとあんちゃん、\n息がぴったりに\nなってきたべ…！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103301, 1258, 1, "おぉ！　そんな急に\nツッコまれたら、\nびっくらこくべやー！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103301, 1259, 2, "ネタはオラが書くけど\nあんちゃんが\n書きたかったら\n書いてもいいんだぞ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103301, 1260, 3, "あんちゃん、オラには\n容赦なんかせずに\nツッコんでくれて\nいいから！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103301, 1261, 4, "押すなよ、\n絶対押すなよ\n…なんて\n言ってないべさ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103301, 1262, 101, "うう…あんちゃんに\nツッコまれたくて\nうずうずしてきたべ～", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103301, 1263, 102, "将来的には夫婦漫才\nってのも…あ、ひ、\nひとりごとだべさ～！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 103301, 1264, 1, "おはよう！　一緒に\n牛の乳しぼりいくべ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 103301, 1265, 2, "お昼だ～腹が減っては\n笑いはできぬ～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 103301, 1266, 3, "今日もよく働いたべ！\nさ、今からは\nお笑いの練習だ～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103301, 1267, 1, "舞台に上がる前に\n身なりは整えねぇと\nだめだべ～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103301, 1268, 2, "ナイスなイスに\n座りたい、\nなんちゃって！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103301, 1269, 3, "めんこいのは、\nスベっても許される\nからずるいべな～？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103301, 1270, 4, "必要以上に\n癒されちまうべや～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103301, 1271, 5, "ぽかぽかだ…\nウケた会場みてぇだ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103301, 1272, 6, "お笑い芸人は、\n体が資本だべさ～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103301, 1273, 7, "もぐもぐ…\nボケることも\n忘れちまう美味さだ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103301, 1274, 8, "ネタ作りのヒントが\n載ってねぇか探すべ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103302, 1276, 1, "さぁ今日も張り切って\n漫才の練習するべさ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103302, 1277, 2, "この部屋でも、商品\n売っていいんだべか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103302, 1278, 3, "眼鏡を頭の上に乗せて\n「メガネメガネ～」\nって言う練習した方が\nいいべか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103302, 1279, 4, "漫才を持ち時間に\n収めるには、何度も\n練習するしかねぇべ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103302, 1280, 5, "エリザベスも\n連れてきてぇ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103302, 1281, 101, "うう…あんちゃんに\nツッコまれたくて\nうずうずしてきたべ～", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103302, 1282, 102, "あんちゃんに\n採れたての食材を\n食わしてやりてぇ～", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103302, 1283, 1, "押すなよ\n絶対押すなよ\n…なんて\n言ってないべさ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103302, 1284, 2, "あんちゃん、百連\nツッコミ特訓だ～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103302, 1285, 3, "あんちゃん、オラには\n容赦なんかせずに\nツッコんでくれて\nいいから！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103302, 1286, 4, "「なんでだべ～！」\nって言いながら\nツッコむといいべ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103302, 1287, 101, "あはは～あんちゃんの\nツッコミはやっぱり\n気持ちいいなぁ～", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103302, 1288, 102, "将来的には夫婦漫才\nってのも…あ、ひ\nひとりごとだべさ～！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 103302, 1289, 1, "おはよう！\n今日もいい\nネタ作り日和だ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 103302, 1290, 2, "お昼だな\nご飯を食べたら、\nネタの練習するべ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 103302, 1291, 3, "もうこんな時間だべ\nネタ作りは\n明日にするべ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103302, 1292, 1, "うーん…衣装、\nずれてねぇべか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103302, 1293, 2, "ナイスなイスに\n座りたい\nなんちゃって！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103302, 1294, 3, "はう～\nなまらめんこいべや～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103302, 1295, 4, "必要以上に\n癒されちまうべや～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103302, 1296, 5, "笑いをとることを\n忘れるほど\nあったけぇべ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103302, 1297, 6, "たくさん運動して\n動きでも笑いがとれる\nように頑張るべ～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103302, 1298, 7, "もぐもぐ…\nボケることも\n忘れちまう美味さだ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103302, 1299, 8, "幅広く教養を\n身につけて\nいいネタ作るべ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103401, 1301, 1, "通りにいる\nカップル…爆発\nすればいいのに…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103401, 1302, 2, "う～ん、仕事なんて\nしないで、\n飲んでたいな～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103401, 1303, 3, "今日は一日、\n外に出ない！\nもう決めたわ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103401, 1304, 4, "お腹空いた…\nけど、外に出るのは\n面倒だなぁ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103401, 1305, 5, "うぅ…頭がガンガン\nする…昨日、\n飲み過ぎたかな…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103401, 1306, 101, "デートとか…\n誘っても嫌がられ\nないかな…？", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103401, 1307, 102, "もしかして運命の\n相手だったり…\nするのかな", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103401, 1308, 1, "やっぱり一杯目が\n一番おいしいわ～！\n…え、見てた！？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103401, 1309, 2, "頼れるお姉さんだって\nところ、もっと見せて\nあげるからね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103401, 1310, 3, "ねえ、一緒に買い物に\n行かない？　その…\nの、飲み物とか…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103401, 1311, 4, "ひっく、うふふ…\nもっとお姉さんと\nお話しようよ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103401, 1312, 101, "極力人付き合いは\nしない主義なんだけど\nキミは例外かも…", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103401, 1313, 102, "いつか…\nキミと一緒に飲めたら\n楽しいだろうな", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 103401, 1314, 1, "おはよう…朝は\nちょっとつらいな…\n低血圧なのよ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 103401, 1315, 2, "おっひるー♪\nなに食べよっかな～♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 103401, 1316, 3, "ふわあ…\n眠る前にちょっと\n一杯…冗談よ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103401, 1317, 1, "うう…\n髪がボサボサ…\nちゃんとしなきゃ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103401, 1318, 2, "自然体でゴロゴロ\nするのって\n幸せだなぁ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103401, 1319, 3, "こういうの男の子に\nプレゼントして\nもらいたいな…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103401, 1320, 4, "うわあ、\nこれ、私の好きな\n香りだー！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103401, 1321, 5, "ぽっかぽか…\nあとは熱い一杯が\nあれば…！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103401, 1322, 6, "家でゴロゴロして\n付いちゃったお肉を\n落とさないと…！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103401, 1323, 7, "もぐもぐ…\nおーいしー！\n…太らないよね？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103401, 1324, 8, "大人の女らしく\n色んなことを学んで\nおかなくっちゃ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103402, 1326, 1, "仕事終わりの一杯の\nために、今日も\n頑張らないと", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103402, 1327, 2, "今日は\nのんびり\n過ごそうかな～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103402, 1328, 3, "あ…\nお皿、洗って\nなかった…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103402, 1329, 4, "もう少し、大人の\n魅力が出せるように\nなりたいな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103402, 1330, 5, "素敵な彼氏…\n欲しいなぁ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103402, 1331, 101, "彼と私\n釣り合うかな…\n大丈夫よね？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103402, 1332, 102, "今後のために\nちょっとは花嫁修業\nしてみようかな…？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103402, 1333, 1, "何事も\nお姉さんと一緒に\n楽しく頑張りましょ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103402, 1334, 2, "ね、ねえ！\nキミは年上と年下\nどっちが好きかな？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103402, 1335, 3, "もう…\n構ってくれないと\n泣いちゃうぞ～？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103402, 1336, 4, "お姉さんが～\n可愛がって\nあげようか～？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103402, 1337, 101, "極力人付き合いは\nしない主義なんだけど\nキミは例外かも…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103402, 1338, 102, "お姉さんとチュー\nする？　ふふふ～\n冗談で～す！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 103402, 1339, 1, "さーて、今日も\nいっちょやるぞー！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 103402, 1340, 2, "後でのんびり\nストレッチでも\nしようっと♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 103402, 1341, 3, "一日よく働いた～！\n自分にごほうび\nあげたいなー♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103402, 1342, 1, "仕事の前に、髪とか\n整えないと…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103402, 1343, 2, "自然体でゴロゴロ\nするのって\n幸せだなぁ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103402, 1344, 3, "もう大人だし…\nあんまり可愛いのは\n似合わないかな…？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103402, 1345, 4, "うわあ\nこれ、私の好きな\n香りだー！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103402, 1346, 5, "あったかーい…\nだ、だらけ\nちゃいそう…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103402, 1347, 6, "地道な努力が\nリア充への\n第一歩！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103402, 1348, 7, "おーいしっ♪\nこのために\n生きてるわねえ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103402, 1349, 8, "大人の女らしく\n色んなことを学んで\nおかなくっちゃ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103801, 1351, 1, "大切な人に\n本をすすめるのって\nけっこう難しいなぁ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103801, 1352, 2, "き、きらーん☆\nお姉ちゃんに\n似てるかな…？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103801, 1353, 3, "そろそろ好きな\n作家さんの新刊が\n出るから楽しみ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103801, 1354, 4, "ちょっと、休憩…\n本でも読もうかな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103801, 1355, 5, "もっとたくさんの本に\n囲まれて生活したいな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103801, 1356, 101, "むかしむかしある所に\nシオリと\nあの人が…", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103801, 1357, 102, "この本の主人公、\nあの人に\n似ているかも…\nかっこいいな", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103801, 1358, 1, "ケホケホ…\nコンコン…\nゴホッゴホッ…\nへ、平気ですよ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103801, 1359, 2, "あ…お姉ちゃんと\n約束があったんだ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103801, 1360, 3, "しおりを探している？\nあ、本に挟む方ですね\nドキドキしました…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103801, 1361, 4, "最近調子がいいのは\n牧場の牛乳やチーズの\nおかげでしょうか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103801, 1362, 101, "読みたい本も\nあなたと行きたい所も\n増えるばっかりです", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103801, 1363, 102, "私の病気、\n悪化してるのかも！？\nすごく胸がドキドキ\nするんです…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 103801, 1364, 1, "えっと、朝食の前には\nこの薬を飲んで…\n食後にはこの薬を…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 103801, 1365, 2, "ふぅ…午前中\n動いたので体力が…\nすこし休みますね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 103801, 1366, 3, "早く寝ないと\n体に良くないですよね\nでも気になっている\n本があって…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103801, 1367, 1, "寝てばかりなので、\n髪が乱れてないかな\n…？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103801, 1368, 2, "少し休もう\n…やっぱり\nたくさん休もう", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103801, 1369, 3, "かわいいものが\n枕元にあると\n安心できるんですよ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103801, 1370, 4, "いい香り…\n病は気からと言うので\n雰囲気も大事ですね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103801, 1371, 5, "こうして温まって\nいると、病気も\n治る気がします", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103801, 1372, 6, "運動…イメージ\nトレーニングだけじゃ\nだめでしょうか…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103801, 1373, 7, "少食ですけど\nこれならたくさん\n食べられそうです", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103801, 1374, 8, "続きが気になって\n読むのを止める\nタイミングが…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103802, 1376, 1, "しっかり休まないと\n早く回復するように", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103802, 1377, 2, "き、きらーん☆\nお姉ちゃんに\n似てるかな…？　", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103802, 1378, 3, "病室よりも…\nずっとこの部屋に\nいたいですね…　", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103802, 1379, 4, "そろそろ好きな\n作家さんの新刊が\n出るから楽しみ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103802, 1380, 5, "大切な人に\n本をすすめるのって\nけっこう難しいなぁ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103802, 1381, 101, "むかしむかしある所に\nシオリと\nあの人が…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 103802, 1382, 102, "あの人の\nためにも早く\n病気を治さないと…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103802, 1383, 1, "ケホケホ…\nコンコン…\nゴホッゴホッ…\nへ、平気ですよ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103802, 1384, 2, "新記録です！\n一週間連続、\n平熱を保ちました！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103802, 1385, 3, "あ…お薬の時間…\n苦いけど我慢しなきゃ　", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103802, 1386, 4, "最近調子がいいのは\n牧場の牛乳やチーズの\nおかげでしょうか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103802, 1387, 101, "しおりを探している？\nあ、本に挟む方ですね\nドキドキしました…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 103802, 1388, 102, "私の病気\n悪化してるのかも！？\nすごく胸がドキドキ\nするんです…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 103802, 1389, 1, "えっと、朝食の前には\nこの薬を飲んで…\n食後にはこの薬を…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 103802, 1390, 2, "…お昼の薬？\nあ、飲み忘れてました\nありがとうございます", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 103802, 1391, 3, "この薬を飲むと\n眠くなっちゃうんです\nでもまだ、あなたと\nお話したいし～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103802, 1392, 1, "寝てばかりなので、\n髪が乱れてないかな\n…？　", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103802, 1393, 2, "少し休もう\n…やっぱり\nたくさん休もう", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103802, 1394, 3, "この子がいれば\n病室に一人でも\n寂しくないですね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103802, 1395, 4, "いろんな効能が？\n健康になる香りも\nあるのでしょうか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103802, 1396, 5, "こうして温まって\nいると、病気も\n治る気がします", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103802, 1397, 6, "私も、少しは\n体力をつけないと\nいけませんよね　", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103802, 1398, 7, "いっぱい食べて\n健康な体にならないと", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 103802, 1399, 8, "続きが気になって\n読むのを止める\nタイミングが…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104001, 1401, 1, "友達ができたら、\n山の上でお弁当…\n夢が広がります…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104001, 1402, 2, "あ、忘れずに\nお花に水を\nあげなきゃ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104001, 1403, 3, "お菓子を作って、\nみなさんに振る舞って\n友達作戦！　とか…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104001, 1404, 4, "そろそろ新しい\n草人形を作って\n友達作りの特訓を…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104001, 1405, 5, "植物のお世話って、\nぼっちにとっては、\n救い…なんです…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104001, 1406, 101, "ＢＢ団の活動日…\nまだかな…\nうふふふっ", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104001, 1407, 102, "もっともっとあの人の\nそばで、一緒に友達を\n作っていきたいな…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104001, 1408, 1, "あ、こんにちは！\n今日もＢＢ団で\nお世話になります！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104001, 1409, 2, "あの…私の友達作りの\n練習方法、間違って\nませんよね…？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104001, 1410, 3, "そうだ、今度、\n森に一緒に木の苗を\n植えに行きませんか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104001, 1411, 4, "人とお話するのって、\n私、大好きです！\n友達ふやすぞ～！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104001, 1412, 101, "あなたと話してると、\nまるで私がぼっちじゃ\nないみたいです！", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104001, 1413, 102, "友達もほしいけど…\nあなたに会えたことが\n私の一番の幸せです", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 104001, 1414, 1, "おはようございます！\n今日もＢＢ団、\nがんばるぞー！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 104001, 1415, 2, "なんだか、お腹が\n空いてきました。\nお昼ごはんー♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 104001, 1416, 3, "もう眠いかもです…\n明日は友達、\nできるといいなあ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104001, 1417, 1, "私がもっと\n可愛ければ、\n友達できるかなあ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104001, 1418, 2, "ふわあ…のんびり\nしすぎないように\n気を付けなきゃです", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104001, 1419, 3, "かわいいなあ。\nこの子とも\n友達になりたい…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104001, 1420, 4, "いい香りです…\n精神統一して\n友達のイメトレ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104001, 1421, 5, "灯りを見てると、\n心がなごみます～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104001, 1422, 6, "もぐもぐ…\nおいしいです…！\nみなさんもぜひ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104001, 1423, 7, "おいしいです…\n私に友達がいたら、\n分けてあげたいな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104001, 1424, 8, "友達作りの\n参考になりそうなこと\n書いてないかな～？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104002, 1426, 1, "友達作りは、焦らず\n慌てず、じっくりと…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104002, 1427, 2, "ひとつ屋根の下\nって感じ…\nいいですねえ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104002, 1428, 3, "煮汁、煮汁が\n噴きこぼれて\nいませんか～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104002, 1429, 4, "今度、みなさんと\nピクニックとか…\nいってみたいな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104002, 1430, 5, "ぼっちでもいい\nたくましく育てば\n…なんて", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104002, 1431, 101, "最近、毎日あの人の\nこと考えちゃいます\nどうしてだろう…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104002, 1432, 102, "もっともっとあの人の\nそばで、一緒に友達を\n作っていきたいな…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104002, 1433, 1, "あ！　ＢＢ団の活動\nですか？　嬉しくて\n飛び跳ねちゃいます！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104002, 1434, 2, "あなたとのお話で友達\n作りの練習になるなら\n一石二鳥です！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104002, 1435, 3, "私少しは人と話しても\nテンパらなくなって\nきましたかね…？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104002, 1436, 4, "あの、友達作りの\n新しい作戦\n考えてみたんですっ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104002, 1437, 101, "あなたとお話する時の\nこの気持ち、私の宝物\nなんです…えへへ", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104002, 1438, 102, "友達もほしいけど…\nあなたに会えたことが\n私の一番の幸せです", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 104002, 1439, 1, "朝ですね！\nこんないい朝は\n友達作りのチャンス！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 104002, 1440, 2, "あの…そろそろお腹\nすきませんか？\nお昼ごはんは…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 104002, 1441, 3, "もう眠いかもです…\n明日は友達\nできるといいなあ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104002, 1442, 1, "私…見た目\nそこまで変じゃ\nないですよね…？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104002, 1443, 2, "ほわあ～…\nふかふかって\nいいものですね～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104002, 1444, 3, "この子みたいな\nあいくるしさを\n目指したいです！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104002, 1445, 4, "灯りを見てると\n心がなごみます～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104002, 1446, 5, "ぬくぬくで、なんだか\n眠くなっちゃいますね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104002, 1447, 6, "身体を鍛えて\nみなさんを\n守ります！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104002, 1448, 7, "もぐもぐ…\nおいしいです…！\nみなさんもぜひ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104002, 1449, 8, "友達作りの\n参考になりそうなこと\n書いてないかな～？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104201, 1451, 1, "唱喚の歌は、みだりに\n歌っていいものでは\nないんです", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104201, 1452, 2, "ここでアイドルの\n練習は、さすがに\n迷惑ですよね？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104201, 1453, 3, "練習してもあんまり\n疲れなくなった…\nアイドルのおかげかな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104201, 1454, 4, "人々の平和を守る旅に\n同行してくれる人を\n探していて…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104201, 1455, 5, "あとで曲を復習して\nおかないと…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104201, 1456, 101, "踊りを見られるのは\nまだ恥ずかしいけど\nあの人になら…", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104201, 1457, 102, "浜辺で曲を書こうと\n思うんですけど…\n一緒に行きませんか？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104201, 1458, 1, "いつも応援ありがとう\nございます♪　これは\nあ、握手の練習です！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104201, 1459, 2, "え、もう練習の時間？\nごめんなさい\nすぐ準備します！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104201, 1460, 3, "守るべき人たちに\n笑顔でいてもらうのも\n大切なんですね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104201, 1461, 4, "歌える曲を増やそうと\n思って。どんな曲が\n聞きたいですか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104201, 1462, 101, "～～♪　あれ？\n今私、歌ってました？\n気づきませんでした", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104201, 1463, 102, "…歌って欲しい？\n喜んで♪\nどの歌にしましょう？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 104201, 1464, 1, "おはようございます♪\n少し歌の練習を\nしてきますね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 104201, 1465, 2, "もうお昼なんですか？\n練習に夢中で\n気づきませんでした", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 104201, 1466, 3, "明日の予定は…\nアイドルはやることが\n多いみたいで…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104201, 1467, 1, "見た目については\n前よりも気をつけてと\nノゾミに言われてます", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104201, 1468, 2, "歌の調子をよくする\nためには休息も\n必要ですよね…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104201, 1469, 3, "この子たちを\n相手に練習して\nみようかな…♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104201, 1470, 4, "…疲れてるのかな\n落ち着けているのが\n自分でもわかります", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104201, 1471, 5, "ここにいると\n穏やかな旋律が\n浮かんできます…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104201, 1472, 6, "歌うためには\n体力づくりは\n欠かせません", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104201, 1473, 7, "歌った後は\nお腹が空いて\nしまうんです", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104201, 1474, 8, "音楽について\n理論も勉強\nしないと…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104202, 1476, 1, "歌うことの楽しさ\n分かってきました\nもっと歌いたいな…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104202, 1477, 2, "練習してもあんまり\n疲れなくなった…\nアイドルのおかげかな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104202, 1478, 3, "精霊も強くなったし\nもっとたくさんの人を\n守りたいです", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104202, 1479, 4, "最近、よく頭の中に\n歌が浮かんできます\n不思議な感覚…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104202, 1480, 5, "楽譜を買いました\n思いついた歌を\n書き留めておくために", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104202, 1481, 101, "浜辺で曲を書こうと\n思うんですけど…\n一緒に行きませんか？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104202, 1482, 102, "私の中にある\n私だけの歌…\n作ってみようかな？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104202, 1483, 1, "守るべき人たちに\n笑顔でいてもらうのも\n大切なんですね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104202, 1484, 2, "歌える曲を増やそうと\n思って。どんな曲が\n聞きたいですか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104202, 1485, 3, "魔物退治ですか！？\n…違います？\n良かった…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104202, 1486, 4, "いつも応援ありがとう\nございます♪　これは\nあ、握手の練習です！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104202, 1487, 101, "…歌って欲しい？\n喜んで♪\nどの歌にしましょう？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104202, 1488, 102, "～～♪　あれ？\n今私、歌ってました？\n気づきませんでした", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 104202, 1489, 1, "呼吸を深く、大きく…\nこれでちゃんと\n目が覚めますよ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 104202, 1490, 2, "少し休んだら\n午後の練習に\n行ってきますね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 104202, 1491, 3, "曲を作っていたら\nもうこんな時間…\nおやすみなさい", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104202, 1492, 1, "見た目については\n前よりも気をつけてと\nノゾミに言われてます", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104202, 1493, 2, "あ～…♪\nよく体がほぐれます…\nいい歌が歌えそうです", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104202, 1494, 3, "かわいいと思う\n気持ちを、歌にしても\nいいかも知れませんね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104202, 1495, 4, "…疲れてるのかな\n落ち着けているのが\n自分でもわかります", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104202, 1496, 5, "ここにいると\n穏やかな旋律が\n浮かんできます…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104202, 1497, 6, "もっと体力をつけて\n最高のライブを\nファンに届けます！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104202, 1498, 7, "これでも一応\n体形には気をつけて\n食べてるんですよ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104202, 1499, 8, "読書は歌に\n新しい風を\n吹き込んでくれます", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104301, 1501, 1, "店の新メニューでも\n考えるかな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104301, 1502, 2, "あたしの店から、\n出前を届けようか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104301, 1503, 3, "パトロール、\nパトロール…\nここは異常なしかな？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104301, 1504, 4, "腹へったら食う！\n悩んだら寝る！\nそれが一番だろ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104301, 1505, 5, "のんびりし過ぎるのも\n…性に合わねぇな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104301, 1506, 101, "そろそろあいつ、\n腹すかしてるん\nじゃないかな？", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104301, 1507, 102, "今日の献立は…\nあいつの好きなものに\nしてやるか", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104301, 1508, 1, "強くなりたいなら、\nあたしがビシバシ\n鍛えてやるよ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104301, 1509, 2, "天気がいい日は\n外で運動したく\nならねぇか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104301, 1510, 3, "腹減ったか？　なんか\n作ってやろうか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104301, 1511, 4, "ん？　なんだよ、\n相談事か？\nなんでも言ってくれ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104301, 1512, 101, "お前が好きな飯って\nなんだ？\n今度、作ってやるよ", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104301, 1513, 102, "お前って不思議だよな\n一緒にいるとなんだか\n…なんでもねーよ", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 104301, 1514, 1, "気持ちいい朝だな！\n体を動かしたい気分だ\n付き合ってくれるか", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 104301, 1515, 2, "昼飯もう食ったか？\nまだなら、あたしが\nなんか作ってやるよ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 104301, 1516, 3, "日中たっぷり動いたら\nそのぶん夜はしっかり\n休んどけよな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104301, 1517, 1, "た、たまにはその…\nかわいい格好とか\nしても…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104301, 1518, 2, "ふわぁ、\n一休みすっかなぁ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104301, 1519, 3, "うっ！　か、かわいい\nじゃねぇか", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104301, 1520, 4, "へー　いい匂いだな\nあいつもこういうの\n好きなのかな…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104301, 1521, 5, "ふわぁ〜！\n温かいと、つい\nウトウトしちまうな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104301, 1522, 6, "オラオラオラーーー！\n燃えるぜーーー！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104301, 1523, 7, "いい味してるぜ！\nうちの店でも\n出してみたいな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104301, 1524, 8, "文字を読んでると\nどうしても眠く\nなっちまうんだよなぁ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104302, 1526, 1, "パトロール終了～\n本日も異常なしっと！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104302, 1527, 2, "あたしの店から\n出前を届けようか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104302, 1528, 3, "あいつ、早く\n帰ってこないかな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104302, 1529, 4, "あいつ\n腹すかせてないと\nいいんだけど…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104302, 1530, 5, "のんびりし過ぎるのも\n…性に合わねぇな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104302, 1531, 101, "あいつの事を思うと\n胸があったかくなる？\nなんだコレ…？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104302, 1532, 102, "今日の献立は…\nあいつの好きなものに\nしてやるか", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104302, 1533, 1, "ん？　なんだよ\n相談事か？\nなんでも言ってくれ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104302, 1534, 2, "天気がいい日は\n外で運動したく\nならねぇか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104302, 1535, 3, "腹減ったか？　なんか\n作ってやろうか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104302, 1536, 4, "腹へったら食う！\n悩んだら寝る！\nそれが一番だろ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104302, 1537, 101, "あのさ…できれば\nもっとそばに…いや\nなんでもねぇ忘れろ！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104302, 1538, 102, "お前って不思議だよな\n一緒にいるとなんだか\n…なんでもねーよ", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 104302, 1539, 1, "気持ちいい朝だな！\n体を動かしたい気分だ\n付き合ってくれるか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 104302, 1540, 2, "昼飯もう食ったか？\nまだなら、あたしが\nなんか作ってやるよ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 104302, 1541, 3, "あんま夜更しすんなよ\n明日に響いたら\n大変だろ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104302, 1542, 1, "た、たまにはその…\nかわいい格好とか\nしても…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104302, 1543, 2, "ふぅ～♪\n疲れがとれるな～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104302, 1544, 3, "うっ！　か、かわいい\nじゃねぇか", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104302, 1545, 4, "へー　いい匂いだな\nあいつもこういうの\n好きなのかな…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104302, 1546, 5, "ふわぁ～！\n温かいと、つい\nウトウトしちまうな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104302, 1547, 6, "オラオラオラーーー！\n燃えるぜーーー！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104302, 1548, 7, "いい味してるぜ！\nうちの店でも\n出してみたいな", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104302, 1549, 8, "料理だけじゃなく\n経営術とかも\n学んどかねぇと…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104501, 1551, 1, "最近なにも\nしてくれません…\n焦らしてるんですね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104501, 1552, 2, "ぐふふ、じゅるり…\nい、いけない、また\nいつの間にかよだれが", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104501, 1553, 3, "好きな武器といえば\n剣より槍より\nやっぱり鞭…ぐふふ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104501, 1554, 4, "「無数の触手が\nクウカの柔肌に\n食い込み」…ぐふふ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104501, 1555, 5, "もしドＳさんが\nＭに転じたらと思うと\n身の毛がよだちます！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104501, 1556, 101, "ドＳさんを登場\nさせるだけで、妄想に\n無限の広がりが！", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104501, 1557, 102, "あっ…\nジロジロ見てたの\n気づいちゃいました？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104501, 1558, 1, "視線を感じると\n思ったら…やはり\nドＳさんでしたか", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104501, 1559, 2, "今日は\nどんなヒドイことを\nしてくれるんですか？\nぐふふふ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104501, 1560, 3, "いつの間にそこに！？\nまさかクウカを監視\nしていたのですか！？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104501, 1561, 4, "クウカに触るつもり\nですか？　触るつもり\nなのですねっ！？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104501, 1562, 101, "クウカにナニをする\nつもりですか…\n期待してしまいます！", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104501, 1563, 102, "ドＳさんの視界に入る\nだけでドキドキが…\nこれが恋！？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 104501, 1564, 1, "おはようございます。\n朝からお盛んですね？\nぐふふ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 104501, 1565, 2, "こんなにも日の高い\nうちからドＳさんは…\nじゅるり", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 104501, 1566, 3, "夜はこれから、\nですよ…\nぐふ、ぐふふふ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104501, 1567, 1, "キレイにおめかし\nしたのに力ずくで…\nぐふふふ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104501, 1568, 2, "ソファの背にクウカを\n押し付けて…ぐふふ\nいいですね\nソファドン", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104501, 1569, 3, "「見た目とは裏腹に\nそれは激しく攻め\nたてて」…ぐふふふ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104501, 1570, 4, "香りを吸ったクウカの\n頬は紅潮し目はうるみ\nもはや抗う力も…！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104501, 1571, 5, "ああ、身体が\n火照って…\nぐふ、ぐふふ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104501, 1572, 6, "はぁ、はぁ、こうして\nクウカの体力を\n奪ってから…ぐふふ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104501, 1573, 7, "食欲が満たされたら\nつ、次はやはり…！\nそうなのですね！？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104501, 1574, 8, "この本の下に、\nそういう本を\nカムフラージュ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104502, 1576, 1, "「ドＳさんと踊り子\n乱舞の一夜」…\n次の日記はこれで…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104502, 1577, 2, "最近なにも\nしてくれません…\n焦らしてるんですね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104502, 1578, 3, "も、妄想が\n足りません…\n禁断症状がっ…！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104502, 1579, 4, "もしドＳさんが\nＭに転じたらと思うと\n身の毛がよだちます！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104502, 1580, 5, "次はどんなドＳを\nされるのか、想像する\nだけで…ぐふふふ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104502, 1581, 101, "じっとしてると\nドＳさんのことばかり\n考えてしまいますね", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104502, 1582, 102, "妄想が止まらなくて\nクウカどうにかなって\nしまいそうです！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104502, 1583, 1, "ドＳさんといると体が\n火照って…クウカは\nいやらしい子です！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104502, 1584, 2, "あっ…\nジロジロ見てたの\n気づいちゃいました？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104502, 1585, 3, "ドＳさんのおかげで\n新しい扉が開けそう\nです…じゅるり", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104502, 1586, 4, "いやー！　ドＳさんに\n襲われ…襲って\nくれないんですか？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104502, 1587, 101, "クウカはドＳさんに\n身も心も堕とされて\nしまったのですね", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104502, 1588, 102, "ドＳさんがお望みなら\nクウカは\nどんなことだって！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 104502, 1589, 1, "朝だからこそ\nできる妄想が\nあります…ぐふふ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 104502, 1590, 2, "こんな日の高いうち\nからドＳさんは…\nじゅるり", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 104502, 1591, 3, "今夜は一晩中…\nなんですね？\nぐふふ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104502, 1592, 1, "意外と難しいんですよ\n正しい亀甲縛りと\nいうものは…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104502, 1593, 2, "くつろいで油断\nしているスキに何を\nされるのでしょう！？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104502, 1594, 3, "「見た目とは裏腹に\nそれは激しく攻め\nたてて」…ぐふふふ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104502, 1595, 4, "これは禁断の香り…\nああっ一段階上の\n妄想が開花するうぅ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104502, 1596, 5, "ああっ、暖気がまるで\nロウソクのように\nクウカを攻めますっ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104502, 1597, 6, "激しい攻めを受けきる\nためには、鍛えないと\nいけないのですね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104502, 1598, 7, "こんなにいっぱい\n入りません…\nお腹にっ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104502, 1599, 8, "どんな本も\nよく見ると\nいやらしいです…！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104601, 1601, 1, "この前遊んだ猫、\nモッフモフ\nだったにゃあ…♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104601, 1602, 2, "ほっぺやお腹が、\n肉球ぐらいぷにぷに…\nこれはまずいにゃ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104601, 1603, 3, "大きな仕事が\n決まったにゃ！\n腕が鳴るにゃ～♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104601, 1604, 4, "おやつのたい焼き、\nつぶあんとこしあん、\nどっちに\nしようかにゃ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104601, 1605, 5, "うにゃー…\nもうちょっとお昼寝\nしたかったにゃ…\nむにゃむにゃ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104601, 1606, 101, "キミに呼ばれると、\n猫まっしぐらな気分に\nなっちゃうにゃ♪", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104601, 1607, 102, "キミのおかげで\nギルドの仕事も\n大成功だにゃ♪\nありがとにゃ♪", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104601, 1608, 1, "うずうず…その指、\nじゃれついても\nいいかにゃ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104601, 1609, 2, "にゃ？　あたしに何か\nご入り用かにゃ？\nお安くしとくにゃ～♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104601, 1610, 3, "うーん、なんだか\n退屈にゃ～\n遊んで、遊んで～？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104601, 1611, 4, "素早い動きのコツ？\nタダじゃ教えて\nあげられないにゃ～♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104601, 1612, 101, "そんなにあたしを\nなでたいにゃ？\nキミならなでさせて\nあげてもいいかにゃー", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104601, 1613, 102, "ふにゃあ、ねえねえ、\n一緒にゴロゴロ\nしようにゃあ？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 104601, 1614, 1, "いい朝にゃ！\n顔を洗ってくるにゃ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 104601, 1615, 2, "むーん、そろそろ\nお昼…猫たちにも\n猫缶を…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 104601, 1616, 3, "ふわあ…眠いにゃ…\n猫は布団で\n丸くなるにゃ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104601, 1617, 1, "客商売では、\n外見のチェックも\n欠かせないのにゃ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104601, 1618, 2, "うにゃ～！\nお昼寝に\nぴったりにゃ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104601, 1619, 3, "これ…量産したら\n子どもにバカ売れ\nしそうだにゃ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104601, 1620, 4, "この灯り、まるで\n猫みたいな\n癒し効果にゃ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104601, 1621, 5, "ふにゃあ、\nあったかいと猫は丸く\nなっちゃうのにゃあ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104601, 1622, 6, "本当は外で\n運動したいん\nだけどにゃ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104601, 1623, 7, "むーん、\n美味しいにゃー！\nたい焼きに\n匹敵するにゃ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104601, 1624, 8, "ふむふむ…猫の\nしつけ方は、と…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104602, 1626, 1, "かわいいネコの置物を\nゲットしたにゃ！\nどこに飾ろうか\nにゃ～♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104602, 1627, 2, "仕事の交渉がうまく\n行ったにゃ～♪\nいい気分だにゃ～♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104602, 1628, 3, "ねこじゃらしには\n食いついちゃうにゃ\nびしっ！　びしっ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104602, 1629, 4, "ほっぺやお腹が、肉球\nぐらいぷにぷに…\nこれはまずいにゃ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104602, 1630, 5, "さっきのたいやき\nおいしかったにゃ♪\nごろごろごろ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104602, 1631, 101, "手作りのたい焼き\nあいつは食べて\nくれるかにゃ…？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104602, 1632, 102, "あいつには、いつか\nたっぷり恩返しが\nしたいにゃ…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104602, 1633, 1, "にゃーに？　あたしの\nことがそんなに気に\nなるのかにゃ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104602, 1634, 2, "あたしのこと…\nしっかり捕まえ\nといてにゃ？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104602, 1635, 3, "あたしの力が\n必要かにゃ？　猫の手\n貸してあげるにゃ♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104602, 1636, 4, "たいやきとクレープを\n合わせれば…\n新しい商売のニオイが\nするにゃ…！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104602, 1637, 101, "ふにゃあ、ねえねえ\n一緒にゴロゴロ\nしようにゃあ？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104602, 1638, 102, "キミと一緒にいると\n楽しくなってつい\nじゃれちゃうにゃ！", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 104602, 1639, 1, "いい朝にゃ！\n顔を洗ってくるにゃ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 104602, 1640, 2, "そろそろおっひる～\nにゃーんか\n食べたい…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 104602, 1641, 3, "うーん、眠くなって\nきたにゃ。あたしは\n夜行性じゃないのにゃ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104602, 1642, 1, "にゃにゃ…\n髪が乱れてるにゃ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104602, 1643, 2, "ふっかふかにゃ～\n猫がねころん\nじゃうにゃ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104602, 1644, 3, "これ、猫と匹敵する\nぐらいかわいいにゃ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104602, 1645, 4, "猫でもこわくない\n優しい灯りにゃ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104602, 1646, 5, "ぽっかぽか\nしあわせな気分にゃ～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104602, 1647, 6, "雨の日でも運動\nできるのは、濡れ\nなくて便利だにゃ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104602, 1648, 7, "美味しいにゃ～！\nこれ、朝昼晩\n食べたいにゃ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104602, 1649, 8, "本を読んで\n猫の気持ちを\n勉強するのにゃ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104801, 1651, 1, "内職手伝える人\nいないかしら？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104801, 1652, 2, "次の依頼は、\nこういう計画で…\nうん、完璧ね！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104801, 1653, 3, "次の特売セールに\n向けて、しっかり\n準備しないと！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104801, 1654, 4, "配達の後に売り子\n次に採取のバイト…\nうん、効率的ね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104801, 1655, 5, "一日に受ける\nバイトの数、もう少し\n増やしたいわね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104801, 1656, 101, "師匠として\n頼りにされたいし\nもっと頑張らなきゃ！", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104801, 1657, 102, "男の子と効率的に\n仲良くなる方法…\nこればっかりは難題ね", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104801, 1658, 1, "あら、\nちょうどよかった\n今から一緒に\nバイトでもどう？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104801, 1659, 2, "相談事かしら？\nそれくらいなら\n無料でいいわよ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104801, 1660, 3, "背後の気配なら\nすぐ分かるわ\n試してみる？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104801, 1661, 4, "道具やお金の管理は\n大丈夫？　手伝うから\nいつでも言って", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104801, 1662, 101, "暇ができたから\n働きたいけど…\nキミとの時間も大切ね", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104801, 1663, 102, "ねえ、あの…\n私はキミにとって…\nいや、何でもないわ", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 104801, 1664, 1, "おはよう！\n今日も朝から\nバイトよ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 104801, 1665, 2, "お昼時ね。\n少し休憩したら、\nまた働くわよ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 104801, 1666, 3, "もうこんな時間！\n明日もバイトで\n朝早いのよ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104801, 1667, 1, "接客業の依頼が\nある時は、外見も\nキレイにしないとね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104801, 1668, 2, "はぁ～バイトで\n疲れたから癒される～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104801, 1669, 3, "これを内職で\n作ったら\n儲かるかしら？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104801, 1670, 4, "リフレッシュできたわ\nこれでまた、バリバリ\n働けるわね！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104801, 1671, 5, "風邪を引いたら効率が\n落ちちゃうから、\n暖めないと！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104801, 1672, 6, "働き続けるには\n健康第一！　それには\n運動が一番よ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104801, 1673, 7, "もぐもぐ…\n腹が減っては\n戦ができぬ、よ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104801, 1674, 8, "日々絶えず学んで、\n生活に活かすのよ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104802, 1676, 1, "家計簿をつけなきゃ！\n覚えている時に\nやっておかないとね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104802, 1677, 2, "次の依頼は\nこういう計画で…\nうん、完璧ね！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104802, 1678, 3, "ギルドの経費\nあとちょっとだけ\n削れそうね…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104802, 1679, 4, "少しでも時給のいい\nバイトがしたいけど\nなかなか\n出会えないのよ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104802, 1680, 5, "今度のバイトも\nなかなか大変そう\nね…腕が鳴るわ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104802, 1681, 101, "男の子と効率的に\n仲良くなる方法…\nこればっかりは難題ね", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104802, 1682, 102, "私、どうしたんだろ？\n仕事中もずっと\n彼のこと考えてる…", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104802, 1683, 1, "この間はヘルプに\n来てくれてありがとう\n頼んで正解だったわ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104802, 1684, 2, "見つけた！　ちょうど\n頼みたいことが\nあるんだけど、いい？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104802, 1685, 3, "今から\n休憩するところなの\n一緒にどう？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104802, 1686, 4, "ん？　どうしたの？\n私のことが\n気になるの？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104802, 1687, 101, "…たまには甘えても\nいい？　私だって\n弱る時はあるのよ", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104802, 1688, 102, "暇ができたから\n働きたいけど…\nキミとの時間も大切ね", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 104802, 1689, 1, "おはよう！\nいい朝ね。一緒に\nランニングでもいく？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 104802, 1690, 2, "お昼時ね\n少し休憩したら\nまた働くわよ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 104802, 1691, 3, "もうこんな時間！\n明日もバイトで\n朝早いのよ…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104802, 1692, 1, "女の子らしく…\nどうも忘れちゃう\nのよね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104802, 1693, 2, "ここで少し\n休んだら\nまたバイトよ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104802, 1694, 3, "これを内職で\n作ったら\n儲かるかしら？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104802, 1695, 4, "仕事から帰ってきて\nこういうのがあると\n素敵ね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104802, 1696, 5, "しっかり身体を\n温めて、血流を\nよくしなくっちゃ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104802, 1697, 6, "これで休憩中も\n無駄なく\n鍛えられるわ♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104802, 1698, 7, "もぐもぐ…よく\n食べて、よく働く！\nそれが私のモットーよ", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104802, 1699, 8, "日々絶えず学んで\n生活に活かすのよ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104901, 1701, 1, "暇だし、お料理と\nお掃除とお洗濯と\n買い物しようかな？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104901, 1702, 2, "こうして歩いていれば\n弟くんが声をかけて\nくれるはず…", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104901, 1703, 3, "弟くんがどんな生活を\nしてるのか調べるのも\nお姉ちゃんの務め！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104901, 1704, 4, "くんくん、\n弟くんのにおい…\n近くにいるね？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104901, 1705, 5, "お姉ちゃんの痕跡を\n部屋中に\n残しちゃおっと♪", 1);
