INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104901, 1707, 102, "はぁ～…弟くん\n禁断症状だよ～", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104901, 1708, 1, "弟くんの部屋は\nお姉ちゃんの\n部屋だよね～", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104901, 1709, 2, "いいこいいこ～♪\nどう、お姉ちゃんの\nナデナデは？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104901, 1710, 3, "姉と弟の外出は\nデートって\nいうのかな？", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104901, 1711, 4, "もう！\nイタズラする子には\nお姉ちゃんチョップ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104901, 1712, 101, "お姉ちゃんが\nぎゅ～ってして\nあげるね♪", 4);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 2, 104901, 1713, 102, "あ、あのね…\nたまにはお姉ちゃんも\n甘えていい？", 8);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 1, 0, 2, 104901, 1714, 1, "着替えは？　荷物は？\nお出かけの準備は\nお姉ちゃんが手伝うね", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 2, 0, 2, 104901, 1715, 2, "出かけるなら\n明るいうちに\n帰ってくるんだよ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 3, 0, 2, 104901, 1716, 3, "まだ起きてるの？\nそれじゃあ、\nお姉ちゃんも\n夜更かししちゃお☆", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104901, 1717, 1, "きれいなお姉ちゃん\n好きだよね♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104901, 1718, 2, "ここにお姉ちゃんの\n匂いを、た～っぷり\n残しておこうっと♪", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104901, 1719, 3, "かわいい♪\nお姉ちゃんチョップ！", 1);
