INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 3, 104901, 1724, 8, "弟くんが読んでいいか\nお姉ちゃんが先に\n中を確認しなくちゃ！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104902, 1726, 1, "暇だし、お料理と\nお掃除とお洗濯と\n買い物しようかな？", 1);
