INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104902, 1729, 4, "弟くんがどんな生活を\nしてるのか調べるのも\nお姉ちゃんの務め！", 1);
INSERT INTO `v1_92beb71d25f5bc4d1179578eed9c9b20180e27ea2ea685f94e284cd8d0d2b4fc` VALUES (1, 0, 0, 1, 104902, 1730, 5, "はっ！\n弟くんが困ってる\n気がする！", 1);
